.信息可能收集的范围与方式如下：</p> <p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">（1）我们提供服务时，可能会收集，储存和使用下列与您有关的信息。如果您不提供相关信息，无法可能注册成为               WorldElite       的用户或无法享受我们提供的某些服务，或者无法达到相关服务拟达到的效果。</p> <p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">（2）您理解并同意，当您使用               WorldElite       及相关服务时填写和/或提供的信息，可能包括姓名、性别、联系方式等单独或者结合识别用户身份的信息。您可以选择不提供某一或某些信息，但是这样可能使您无法使用               WorldElite       的相关特殊服务。</p> <p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">2.我们因您使用               WorldElite       及相关服务而获取的信息如下： （1）当您使用               WorldElite       产品或服务时，为使您获得更轻松的访问体验，我们可能会使用各种技术来收集和存储信息，在此过程中可能会向您的设备发送一个或多个的Cookie或匿名标识符。这么做是为了了解您的使用习惯，使您省去重复输入注册信息等步骤，或帮助判断您的账户安全。</p> <p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">（2）当您使用               WorldElite       或服务时，我们可能会利用Cookie和同类技术收取您的信息用于了解您的偏好，进行咨询或数据分析、改善产品服务即用户体验、提高广告效果、及时发现并防范安全风险、为用户和合作伙伴提供更好的服务。</p> <p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">（3）我们不会将Cookie用于本隐私政策所述目的之外的任何用途，您可以根据自己的偏好留存或删除Cookie。您可清除软件或网页中保存的所有Cookie，当您手动清除后，您的相关信息即已删除。</p> <p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">3.某些移动设备或应用包含唯一应用程序编号。例如您使用的移动设备，浏览器或您使用的用于接入               WorldElite       服务的其他程序所提供的配置信息、设备版本号和设备识别码、IP地址等。为了提供更好的服务与改善用户体验，我们可能会记录硬件型号、操作系统版本号、国际移动设备身份码（ IMEI）、网络设备硬件地址（MAC）等信息。</p> <p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">4.当您开启设备定位功能并使用               WorldElite       基于位置提供的相关服务时，系统会通过GPS或WLAN等方式自动处理有关设备的位置信息，以使得您不需要手动输入自身地理坐标就可获得相关服务。您可以通过关闭定位功能，停止               WorldElite       对您的地理位置信息的收集（大多数移动设备将允许您关闭定位服务，具体建议您联系您的移动设备的服务商或生产商）。</p> <p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">5.通过使用收集的信息，我们会得以向您提供个性化的服务并改善现有服务。</p> <p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">6.通过使用收集的信息，向您提供更加相关广告以替代普遍投放的广告。</p> <p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">7.可能我们会与其他合作方共同向您提供服务或内容。在服务或内容为该项产品 /服务所必须的情况下，您同意我们可与其分享您的个人信息，并且我们将努力确保该第三方在使用您的个人信息时同时遵守本隐私政策以及其他的保密及安全义务。</p> <p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">8.我们不对外公开或向第三方提供用户的个人信息，但下列情况除外：</p> <p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">（1）事先获得您的明确授权;</p> <p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">（2）您分享的信息;</p> <p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">（3）根据有关的法律法规或按照司法，行政等国家机关的要求;</p> <p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">（4）出于实现我们对您个人信息合理使用的目的，或为履行本协议相关条款的规定或本隐私政策中的义务和行使我们的权利，向我们的关联方、合作伙伴或代表我们履行某项职能的第三方（例如代表我们发出推送通知的通讯服务商等）分享您的个人信息;</p> <p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">（5）以维护公共利益或学术研究为目的;</p> <p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">（6）为维护               WorldElite       其他用户、我们及第三方的合法权益，例如查找、预防、处理欺诈或安全方面的问题;</p> <p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">（7）我们为维护合法权益而向用户提起诉讼或仲裁;</p> <p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">（8）在涉及合并、分立、收购、资产转让或类似的交易时，如涉及到个人信息转让，我们会要求新的持有您的个人信息的第三方继续受本隐私政策的约束，否则，我们有权要求第三方重新取得您的授权同意;</p> <p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom: 8px; margin: 0; line-height: 26px; color: black;\">（9）符合本用户协议相关条款的规定。</p> <p data-tool=\"mdnice编辑器\" style=\"font-size: 16px; padding-top: 8px; padding-bottom:', '2020-04-16 16:08:08', '2020-04-16 16:08:08');
