INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (4, 6, '职位职责：\n1、负责用户侧、后台的服务器端开发；\n2、对现有架构、性能进行优化。\n\n职位要求：\n1、熟练掌握PHP开发，熟悉Yaf、Zend 、CodeIgniter、Yii等任一一种框架；\n2、计算机相关专业统招本科以上学历，2年以上LNMP开发工作经验；\n3、熟悉GNU Linux，熟悉SQL，并了解常用的SQL优化技巧；\n4、熟悉JavaScript/Ajax/JQuery等相关技术；\n5、熟悉Memcached或Redis、MongoDB等NoSQL技术，有大规模系统设计和开发经验者优先；\n6、学习能力强，具备良好的问题分析和解决能力，对新技术有敏感性并愿意致力于新技术研究；\n7、质量意识高，对项目质量追求完美；\n8、沟通能力强，良好的团队合作精神；\n9、有电商相关开发经验优先。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (5, 7, '职位描述\n1、研究数据挖掘或统计学习领域的前沿技术，针对海量数据，构建和优化群体画像；\n2、参与风控、精准营销、个性化定价等模型建设和领域研究，提升产品效果；\n3、根据公司需要，对原始数据进行清理、甄别、归类和整合，并实现流程自动化。\n职位要求\n1、机器学习、数据挖掘相关方向硕士及以上学历或 2 年以上工作经验，对群体画像分层/推荐系统有经验者优先考虑；\n2、熟悉C/C++语言、Python、Java任意一种语言，较强的算法和数据结构功底；熟悉大规模数据挖掘、机器学习等相关技术, 熟悉Hadoop/Spark/Hive技术优先；\n3、良好的逻辑思维能力,优秀的分析和解决问题的能力,对挑战性问题充满激情；\n4、良好的团队合作精神,较强的沟通能力。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (6, 8, '职位描述\n1、负责全媒体智能通信C/C++后端服务开发与维护，支持字节跳动全球通信业务；\n2、负责高质量的设计和编码，承担重点、难点的技术攻坚；\n3、参与或主导系统架构设计、技术选型、开发任务分解、工作量评估；\n4、分析解决系统性能问题，提升系统稳定性、伸缩性、扩展性。\n职位要求\n1、本科及以上学历，扎实的计算机专业基本功；\n2、优秀的编码与代码控制能力, 有扎实的数据结构和算法功底；\n3、熟悉Linux开发环境，熟悉C++, 精通网络编程、多线程编程；\n4、善于学习和运用新知识，具有良好的分析和解决问题能力；\n5、具有良好的团队合作精神和积极主动的沟通意识；\n6、熟悉SIP、RTP/RTCP协优先；\n7、熟悉PCM、SILK、iLBC、Opus、VP8、H.264等音视频相关技术优先。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (7, 9, '职位描述：\n任职要求：\n\n1、计算机相关专业毕业本科2年以上工作经验。\n\n2、熟练掌握winform、webAPI、NuGet、git\n\n3、良好的沟通交流能力，能将团队压力转换成动力。\n\n4、诚实、敬业，热爱编程和挑战难度是必须的，优秀的团队合作能力\n\n\n\n岗位职责：\n\n1、根据现有要求，对公司C#软件进行维护、升级\n\n2、能独立完成软件项目的设计、开发、测试等工作\n\n3、解决项目中的关键问题和技术难题，把握项目进度；\n\n4、良好的沟通能力、强烈的责任心和敬业精神。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (8, 10, '职位诱惑：\n完善的培训体系 发展空间大\n职位描述：\n岗位职责：\n1、按照公司项目开发计划，完成开发任务；\n2、根据开发流程完成模块的设计、编码、测试以及编写相关文档；\n3、参与产品、项目的需求分析及设计开发工作；\n4、参与方案讨论和技术调研、负责方案升级、更新，对项目实施提供支持。\n\n任职要求：\n1、 全日制统招本科及以上学历。\n2、一年以上.Net开发经验，有B/S项目的开发经验；\n3、熟悉C#语法，熟悉.net framework特性，熟悉.net MVC框架，了解常用设计模式；\n4、熟悉数据库基本设计思想，SQL功底较好，能编写简单存储过程；\n5、熟悉JavaScript基本语法，熟悉Jquery基本语法，对CSS有所了解；\n6、能接受出差或驻场开发优先；', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (9, 11, 'Hadoop研发工程师\n上海研发 - 大数据社招\n职位描述\n1、Hadoop 技术栈的开发和管理，解决实际业务挑战，e.g. YARN, HDFS, MapReduce, Spark, etc；\n2、与开源社区保持交流，发现对业务场景有帮助的特性并引入生产环境，或将经内部验证的特性贡献到社区；\n3、承担千台-万台规模 Hadoop YARN 集群的管理工作，与业务一起解决性能优化、容量规划、预算审计等问题，保障集群高效稳定经济运行。\n职位要求\n1、思维活跃，熟悉 Hadoop Stack 及相关基础设施；\n2、优秀的设计和编码能力：针对具体的业务场景问题，快速设计和实现解决方案；对工程质量有很高的自我要求；', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (10, 12, '职位描述\n1、负责今日头条沟通系统研发，包括但不限于即时通讯(IM)工具；\n2、负责效率工具的后台开发工作，具体包括需求分析、文档撰写、设计编码、测试运维、效果追踪等工作；\n3、负责高质量的设计和编码；承担重点、难点的技术攻坚；\n4、参与产品讨论和开发实现；\n5、主要语言为Python/Golang。\n职位要求\n1、良好的设计和编码品味，热爱写代码；\n2、较好的产品意识，愿意将产品效果做为工作最重要的驱动因素；\n3、掌握WEB后端开发技术: 协议、架构、存储、缓存、安全等；\n4、积极乐观，认真负责，乐于协作。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (11, 13, '职位描述：\n岗位职责:\n\n1、负责HIS软件研发；\n\n2、根据需要完成系统的详细设计和相应文档；\n\n4、能够遵循编码规范完成基于DELPHI的相应编码任务；\n\n5、能够配合项目人员完成结合测试、系统测试和系统交付工作；\n\n6、能够对系统进行升级和维护等工作。\n\n \n\n任职要求：\n\n1、统招本科以上学历，计算机相关专业；\n\n2、熟悉DELPHI开发应用，2年或以上使用经验；\n\n3、熟悉SQL SERVER数据库开发应用，两年或以上使用经验；\n\n4、具备医疗行业软件开发经验者优先。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (12, 14, '职位描述：\n岗位职责：\n负责香港虚拟银行的中后台产品设计，包括但不限于银行资金结算渠道建设、业务场景平台系统建设和银行合规系统设计和迭代工作； \n负责收集、分析、转化业务部门需求，以形成产品方案，组织相关业务需求评审，推动保证产品的上线与迭代优化，确保产品项目的整体进度； \n负责产品数据的日常整理和分析，对产品进行上线跟踪和持续优化，对业务稳定性和健壮性负责；\n岗位要求：\n本科以上学历，有3年以上支付机构/金融机构工作经验，有银行资金结算体系、支付核心模块成功项目经验优先； \n具备复杂平台产品需求抽象能力，有较强的数据分析能力，能够发现产品问题，并独立提出产品解决方案；\n推动力强，学习能力强，具有良好的协调沟通能力、组织能力和项目管理能力，能在较大压力下完成挑战性工作；', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (13, 15, '', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (14, 16, '岗位职责\n1. 在现有产品或私有化后的产品中，完成功能研发\n2. 完成大型企业的信息系统与金数据的集成\n3. 优化私有化部署流程\n任职要求\n1. 本科以上，具有五年开发经验，具体技术栈要求：\n  a. Ruby/Rails\n  b. Mongodb/PostgreSQL/Redis 等数据库技术\n  c. Sidekiq 等后台任务技术\n  d. HTML/Javascript/CSS/jQuery 等前端技术\n  e. 自动化单元测试技术\n2. 具有三年以上 Web 开发经验，了解互联网产品的部署\n3. 有担当，具有较强的执行力\n4. 具有较强的解决问题能力和任务规划能力。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (15, 17, '职位描述\n1、参与公司对外产品的前后端基础架构的设计与实现，提供稳定可靠的服务；\n2、负责内部平台的前后端架构设计与实现；\n3、负责技术攻关和创新技术引用，解决产品开发过程中的高性能，高并发和高可靠性问题。\n职位要求\n1、 3年以上互联网开发经验，对 Unix/Linux 有深入了解；\n2、 出色的编码能力，精通 Node.js，熟悉常用的算法，熟悉开源框架，解决问题能力强；\n3、 熟练掌握前端框架 React/VUE，熟悉前端工程化及组件化开发模式；\n4、 对后端程序性能优化有丰富经验；\n5、 掌握 Redis、MongoDB、MySQL 等存储系统原理及应用；\n6、 对分布式计算，分布式存储的架构设计理念和动机有一定理解；\n7、 对 HTTP 协议有深刻的理解，熟悉 TCP/IP 等网络协议；\n8、 加分项：有 Python、Go、PHP 开发经验；参与或拥有开源项目，为开源社区贡献过代码；有大规模后端服务的设计和开发方面经验。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (16, 18, '职位描述\n1、负责搜索排序、query分析、相关性计算、个性化搜索等技术方向的深入研究，设计算法方案并调优算法效果；\n2、深度理解和参与用户搜索体验优化，与业务一起高速成长。\n职位要求\n1、 熟练掌握C/C++编程技能，有扎实的编程基础、良好的编程风格和工作习惯；\n2、出色的分析问题、解决问题能力，总是能从纷繁复杂的数据中一眼看出问题本质；\n3、强悍的代码能力、数据结构和基础算法功底；\n4、出色的机器学习（Deep Learning）、NLP和数据探索基础，并能很好地建模应用于解决搜索问题；\n5、有大规模搜索引擎算法优化经验优先。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (17, 19, '职位描述：\n1. 负责MX player的后端服务研发工作，为海量用户提供可靠服务与优质体验\n2. 参与服务器端的需求分析与制定，业务架构设计，模块分解与实现，性能监控与调优\n3. 随着业务量与复杂度的增长，持续消除技术瓶颈，追踪与预判现有架构中的潜在问题，保障业务快速迭代\n4. 对不特定的商业或开源技术产品进行快速学习与尝试，对重度依赖的技术产品深入探索原理\n任职要求：\n1. 3-6工作经验，精通Java/Go当中的一种语言，具有良好的编程能力\n2. 熟悉在线业务开发领域的常见技术与设计模式：网络协议、数据库、缓存、负载均衡、接口设计规范等\n3. 对关系型数据库与至少一种NoSQL数据库具有深度使用经验，掌握一定的原理知识\n4. 深入思考并解决过业务数据一致性与可靠性相关问题\n5. 经历过某一在线服务架构的长期迭代与平滑重构升级，有相关经验者尤佳\n工作地址', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (18, 20, '职位描述\n1、负责公司短视频业务算法工作，共同搭建业界领先的推荐系统；\n2、深入理解业务和机器学习技术，优化模型&策略，持续提升推荐效果；\n3、深入理解用户行为，结合数据挖掘等技术，优化用户创作和浏览等体验；\n4、深入理解内容安全策略，结合机器学习等技术，优化业务流程和效率。\n职位要求\n1、具备优秀的编码能力，扎实的数据结构和算法功底；\n2、优秀的分析问题和解决问题的能力，对解决具有挑战性问题充满激情；\n3、对技术有热情，有良好的沟通表达能力和团队精神；\n4、熟悉机器学习、自然语言处理、数据挖掘中一项或多项，对推荐系统、计算广告、搜索引擎相关领域有经验者优先。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (19, 21, '岗位职责：\n\n- 负责 EMQ X 产品开发；\n- 负责 Github 开源社区日常维护；\n- 负责大客户项目开发支持；\n\n\n任职要求：\n\n- 计算机、物理、数学专业，本科及以上学历；\n- 2年以上 Erlang 项目开发经验，熟悉 Erlang 函数型编程方法，熟悉网络和并发编程、分布式编程；\n- 熟悉常见开源项目集群架构，例如 Redis、Cassandra 的集群模式；\n- 熟悉网络协议栈，比如 TCP/IP 协议、MQTT 协议、HTTP协议等；\n- 熟悉 Linux 环境及相关操作；\n\n加分项：\n\n- 使用 Github 并发表过原创内容或为开源项目做过贡献；\n- 熟悉 HBase 等基于列式存储数据库者优先考虑；\n- 10台以上Erlang节点集群经验，理解 Netsplit 处理，Raft 一致性协议；', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (20, 22, '职位描述\n1、搜索场景中的用户意图的挖掘与识别，相关技术的实现与落地；\n2、Query结构化分析及槽位填充（Slot Filling）相关技术研发及产品落地；\n3、结合亿级用户搜索和推荐场景，应用NLP、ML、AI技术解决实际问题；\n职位要求\n1、Query理解、对话理解、意图识别&槽位填充、命名实体识别等方向相关算法研究和应用开发；\n2、熟悉常用的NLP、机器学习和深度学习技术，对短文本分类，序列标注，语言模型，同义词挖掘，CFG/PCFG/CYK等经典算法理论熟悉并具有相关实践经验；\n3、具有较强基础算法和编程能力，并熟悉C/C++或Python任一种语言；\n4、熟悉TensorFlow/PyTorch/MXNet等开源深度学习框架者；\n5、有高水平论文者优先，包括但不限于ACL、EMNLP、NIPS、WWW、AAAI等。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (21, 23, '', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (22, 24, '岗位职责： \n 负责内部数据采集系统的整体设计开发，保证有效结果。 \n 解决系统遇到的业务、技术方面问题，寻找可行的改进方案并推行 \n 指导初级中级工程师，引领团队的技术氛围。 \n岗位要求：\n1、岗位基本要求：  对数据采集有深入理解，有丰富的开发、封禁破解经验 \n2、扎实的计算机专业基本功，强大的写码能力；\n3、熟练使用 Spring、Spring MVC、MyBatis 等框架，并对框架原理有了解 \n4、熟悉 MySQL 的应用开发、常见的性能调优和可扩展性设计，对事务、锁、并发等实现机制有了解 \n5、高度的创业心和投入度，既能搞定技术难题，同时又能密切关注业务，有产品意识和想法。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (23, 26, '职位描述\n1、使用flutter技术栈，负责公司新产品的功能研发和性能优化，完成高质量编码和测试工作；\n2、和产品经理配合，深度参与手机产品需求讨论，功能定义等 ；\n3、设计良好的代码结构，不断迭代重构，跟进flutter社区技术进展；\n4、承担重点、难点的技术攻坚。\n职位要求\n1、本科及以上学历，计算机、通信等相关专业；\n2、具有扎实的编程功底，良好的设计能力和编程习惯；\n3、有丰富的安卓或iOS开发经验，熟悉系统机制和特性，有大型app开发经验；\n4、学习能力极强，有跟进新技术的能力和意愿，有通过阅读及调试系统级代码排查和解决问题的能力；\n5、积极乐观，责任心强，工作认真细致，具有良好的团队沟通与协作能力；\n6、对产品有好奇心，关注业内产品，喜欢使用产品，关注产品体验；\n7、热爱移动产品研发，有较强的学习能力，有强烈的求知欲、好奇心和进取心 ，能及时关注和学习业界最新的移动开发技术。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (24, 27, '岗位职责\n1、负责咪咕阅读前端前沿技术研究和技术方案的规划落地及技术攻坚；\n2、依据产品需求完成高质量的多终端（客户端，WAP，小程序等）前端开发和维护；\n3、负责解决前端开发过程中遇到的问题，在理解产品业务的基础上，提升产品的用户体验，技术驱动业务的发展；\n4、负责对前端开发技术进行深入研究，根据开发过程中的体验对产品提出改进建议。\n\n任职要求\n1、教育：全日制本科及以上学历，计算机、通信、电子类等相关专业优先；\n2、知识：具备跨终端的前端开发能力，在Mobile/Hybrid App/小程序等方面至少有一个有精通方向，具备多个的更佳；\n3、经验：具有4年以上前端开发经验，其中2年以上移动端开发经验，有大型APP架构开发都优先；有阅读类产品开发经验者优先；有react，reactNative等开发经验者优先。\n4、技能：对前端CSS、JS、H5有丰富经验，对前端框架React、ReactNative要能熟练运用，对前端工程化与模块化开发要有一定了解，并有实践经验(如Webpack/Gulp/NPM/YARN 等)；精通前端性能优化；熟练掌握面向对象设计技能，有良好的代码习惯和风格；\n5、素质：品德优秀，身体健康；具备良好的职业素养及团队合作精神；工作积极主动，责任心强，能承受较大工作压力。\n工作地址', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (25, 28, '职位描述：\n参与MXPlayer的功能开发，性能优化。MXPlayer拥有亿级日活，无论从本地播放器的开发，到在线内容平台的开发都具有很强的技术深度和挑战。\n工作职责：\n1、Android移动终端应用的开发\n2、和产品经理、UI设计师配合，完成项目开发\n3、定期修复测试工程师提交的Bug，以及其他优化需求、维护工作等\n4、定期的技术研究与调研\n任职要求：\n1、计算机、软件工程等相关专业，本科及以上学历\n2、3年以上Android平台开发经验，熟悉Java\n3、熟悉Android布局，常用web框架，http, tcp/ip协议\n4、熟悉各Android版本特性及适配，主流机型特性及适配\n5、良好的代码习惯，良好的自测试意识，良好的文档维护能力；阅读并理解英文资料的能力\n6、有解决问题、钻研新技术的兴趣和能力，良好的团队合作精神\n工作地址', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (26, 29, '职位描述：                                                                                                                                                                                                    职位职责：\n1、负责公司新产品的功能研发和性能优化，完成高质量编码和测试工作；\n2、和产品经理配合，深度参与手机产品需求讨论，功能定义等；\n3、设计良好的代码结构，不断迭代重构；\n4、承担重点、难点的技术攻坚。\n职位要求：\n1、本科及以上学历，计算机、通信等相关专业；\n2、具有扎实的编程功底，良好的设计能力和编程习惯；\n3、熟练掌握Objective-C，熟悉Swift的优先；\n4、一年以上iOS开发经验,能独立开发iPhoneApp者优先；\n5、有较好的产品意识；\n6、积极乐观，责任心强，工作认真细致，具有良好的团队沟通与协作能力；\n7、对产品有好奇心，关注业内产品，喜欢使用产品，关注产品体验；\n8、热爱移动产品研发，有较强的学习能力，有强烈的求知欲、好奇心和进取心 ，能及时关注和学习业界最新的移动开发技术', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (27, 30, 'wp项目是做华为终端产品的服务子项的，全称workplace，类似于工作台那种，架构可以带五个人的小团队，每个特性团队的组成是3前端+1后台+1测试，目前项目开发模式是每个特性团队负责一个模块。整个项目web前端为主，框架vue为主。4年经验可做WebSE，带团队！所做产品，公司员工已经使用！亮点“整个项目前端为主，前端占比95%，均中高级，不香吗？？双休，不强制加班，以结果为导向加班制度', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (28, 31, '职位描述：\n职位职责：\n1、负责Web前端工程师工作；\n2、根据设计师的效果图，生成相关页面；\n3、能够理解后端架构，与后端工程师配合，为项目提供最优化的技术解决方案；\n4、持续的优化前端体验和页面响应速度，并保证兼容性和执行效率。\n职位要求：\n1、本科及以上学历，计算机类相关专业，2年以上前端开发经验；\n2、对前端开发技术有深厚理解，能独立搭建web端产品开发框架；\n3、熟练掌握并使用Html5、JavaScript和CSS3相关技术；\n4、熟练掌握React编写前端页面；\n5、精通掌握主流的JavaScript框架（Nodejs、jQuery、AngularJS、ReactJs、VueJs）;\n6、精通Sketch、PS、AI、Dreamweaver等视觉设计软件者优先；\n7、有企业级数据分析产品开发经验者优先；\n8、有良好的沟通能力，能承受较强的工作压力，具有团队合作精神，能够站在用户的角度去理解问题，发掘不足，善于总结。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
