INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (31, 34, '职位描述\n1、负责Unity3D手游项目的客户端重要功能模块开发；\n2、负责开发游戏所需的相关工具、插件的开发及相关SDK的接入；\n3、参与Unity3D手游项目的性能分析和优化及技术难点攻坚，对游戏品质和性能负责。\n职位要求\n1、本科及以上学历，计算机相关专业；\n2、4~7年Unity引擎项目开发经验；\n3、熟练运用C#， Lua语言撰写客户端代码；\n4、良好的数学和计算机图形学基础，熟悉Direct3D或OpenGL；\n5、熟悉Direct3D硬件管线和可编程管线，渲染管道优化经验，良好的shader开发经验；\n6、有良好的编程习惯和风格，逻辑思维能力强，学习能力强，具有良好沟通能力，工作严谨认真；\n7、具有良好的团队精神，具备独立解决问题的能力。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (32, 35, '职位一：前端\nNode.js开发工程师\n技能要求：\nNode.js，JS\n主要工作职责：\n负责棋牌游戏开发, 能够完成游戏客户端,或服务端的开发任务。\n任职要求：\n1、熟练掌握 JS, JavaScript，Node.JS等；\n2、有微信小游戏开发经验优先；\n3、有责任心，有很好的抗压能力, 积极进取, 有上进心。\n\n职位二 ：前端\nCocosCreator开发工程师：\n技能要求：\nCocosCreator，JS，Node.JS.\n1、负责开发基于CocosCreator引擎制作的游戏。\n2、负责服务端进行数据对接并处理。\n3、负责游戏客户端的界面制作。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (33, 37, '职位描述\n1、负责云平台产品的质量保证工作；\n2、独立完成测试需求分析和设计、并输出测试用例。\n职位要求\n1、3年以上测试经验，熟悉软件测试理论、测试设计以及方法；\n2、良好的质量意识，能够快速推进问题的闭环；\n3、熟悉Linux操作系统，熟悉Docker；\n4、熟悉一种开发语言，如JavaScript, Python, Shell,Go等；\n5、有较强的逻辑思维能力，具备良好的分析总结问题能力和沟通能力；\n6、工作认真负责、耐心细致，具有良好的团队意识。\n\n【加分项】熟悉 Kubernetes、TensorFlow、CI/CD。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (34, 38, '职位描述：\n1、负责自动化测试平台建设及维护、优化；\n2、设计自动化测试框架及自动化测试方案；\n3、熟悉接口测试，掌握接口、UI自动化；\n4、开发自动化测试用例并编写自动化测试脚本，提升测试效率；\n5、开发测试工具、进行测试脚本及测试工具代码的维护。\n\n岗位要求：\n1、大专或以上学历，计算机相关专业；\n2、1年以上自动化测试相关经验；\n3、熟练掌握使用至少一门开发编程语言，如Java、Python等；\n4、熟悉jenkins、linux及dos命令；\n5、熟悉软件测试理论和方法，熟练selenium，appium,并能独立搭建框架；\n6、能够展示自己自动化测试框架或成果作品可加分。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (35, 39, '岗位职责：\n1、产品迭代交付测试；\n2、线上问题复现及跟进处理；\n3、以提升质量和效率为目的的测试技术应用；\n岗位要求：\n1、熟悉软件测试方法和技术，至少有2年 Web、H5测试经验；\n2、能熟练使用SQL，有mysql、MongoDB使用经验；\n3、熟悉API测试工具，如：postman;\n4、通测试用例设计，了解测试计划、测试方案、测试总结；\n5、良好的问题定位和跟踪能力；\n6、对测试感兴趣,能够接受一定的重复性工作；\n7、能够承受一定的工作强度和压力，具备一定的沟通能力和良好的团队合作能力；\n8、具备很强的学习能力，能够接受新的事物\n优先考虑：\n1、有CRM测试经验者\n2、熟悉JAVA，有一定代码能力', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (36, 40, '职位描述\n1、负责公司 Android 平台大型项目的软件性能测试工作和性能优化工作；\n2、负责性能关键指标的测试，找到性能瓶颈、提出性能提升的可行性分析；\n3、负责性能测试过程改进和工具优化，必要时开发新的工具；\n4、监控各业务模块的内存、CPU、GPU 等使用状态，识别各类耗时操作；\n5、参与建设各业务场景的性能 Benchmark；\n6、负责调研业界智能手机的性能以及趋势，提出优化目标及策略。\n职位要求\n1、计算机相关本科及以上学历，有3年以上大型 Android 平台大型项目测试开发经验；\n2、至少有 Shell、Python 任意一种脚本开发能力；\n3、有 Android 平台性能测试架构搭建和优化经验；\n4、熟练使用 systrace、Memory Monitor 等 Android 各种性能分析工具；\n5、有 Android 智能手机性能测试经验者优先。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (37, 41, '职位描述\n1、负责业务质量保障和专项测试能力建设，通过流程优化和测试方法创新，提升研发质量和效率；\n2、开发行之有效的测试工具和自动化测试框架、脚本，通过持续集成，提升测试效率；\n3、深入了解业务线现状，并持续优化产品、研发流程，提升整体质量和效率。\n职位要求\n1、3-5年服务端测试开发经验或专项测试经验（性能、安全、稳定性）；\n2、精通至少一个常用测试框架；\n3、熟练掌握 Java/Go/Python 等任意一门语言；\n4、精通测试分析，有较强的业务分析能力和问题定位能力；\n5、熟悉持续集成、持续交付体系，并有落地经验；\n6、良好的沟通表达和协调能力，能协调各个角色解决问题；\n加分项：\n1、大型项目负责人或大流量稳定性保障经验;\n2、具备良好的技术视野。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (38, 42, '职位职责：\n1、主要负责客户端相关质量保证工作；\n2、根据产品设计或需求，进行需求分析，制定测试计划、风险评估、设计测试数据和测试用例，执行测试用例，准确定位并追踪问题等；\n3、对线上问题进行持续追踪，并从中得出一些优化监控、提升测试方案等的改进措施；\n4、对产品提出改进建议以建立**的用户感受，对项目提出改进建议以提高项目整体效率；\n5、在项目中保持和产品经理、开发工程师、用户等积极有效沟通，推动问题及时合理地解决，并保持总结问题。\n职位要求：\n1、本科及以上学历；\n2、熟悉Android/iOS平台特性，熟练使用客户端测试相关工具（Instruments/Traceview/Charles）；\n3、较强的编码能力，至少熟悉Java/Python/Ruby/Go/JavaScript等主流语言中的一种，有客户端编程经验者优先；\n4、对性能测试/稳定性测试/兼容性测试/电量测试/弱网络测试有独到见解者优先。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (39, 43, '职位描述\n1、参与需求评审，善于挖掘需求问题 ；\n2、设计测试用例和需求分析并定期维护 ；\n3、熟悉Bug生命周期，对Bug进行推动，跟踪反馈 ；\n4、与研发、策划、客服、运营人员进行良好的沟通，及时跟进待测任务开发进度；\n5、根据研发进度合理调整测试计划，并执行测试，汇报测试结果 ；\n6、部署和维护测试环境 。\n职位要求\n1、熟悉游戏测试流程和规范，掌握软件测试基本理论知识，逻辑思维清晰 ；有敏捷开发经验者优先 ；\n2、熟悉iOS、Android系统，对以上平台游戏产品具有一定了解；\n3、具备3年以上手机游戏测试工作经验；有休闲游戏研发测试经验优先；\n4、熟悉adb，SQL，Linux等常用基本命令语句，有至少一款抓包工具的使用经验 ；\n5、有接口测试，性能测试，兼容性测试等专项测试经验者优先 ；\n6、有一定的英语读写能力；\n7、有代码能力者优先。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (40, 44, '职位描述\n1、负责智能硬件产品的各功能模块功能与性能的硬件测试研究，包括基带、射频测试等；\n2、负责专项测试工作，包括LCD/CAM/音视频/电池/传感器等，熟悉相关模块的设计原理，能够设计可行的性能测试用例；\n3、负责产品可靠性测试研究，根据产品的硬件设计规格书，可靠性标准、测试规范设计可靠性测试用例；\n4、负责产品认证测试的研究工作，精通CE、FCC、CTA等认证中的测试标准，包括安全、RF、EMC、OTA等；\n5、负责根据产品的硬件特性和新特性分析和设计测试用例；\n6、负责跟进产品硬件类失效的问题，并能完成初步的技术分析；\n7、上述1/2/3/4，有一项研发设计和测试工作有专长即可。\n职位要求\n1、大学本科以上学历，电子、机械等相关专业；\n2、熟悉智能硬件测试标准和方法；熟练使用相关测试仪表；熟悉测试数据的分析和总结 ；\n3、熟悉电子行业测试标准；\n4、有一定动手操作能力，有良好的沟通和团队合作能力；\n5、熟练的英文读写能力；\n6、从事智能硬件开发和硬件测试2年以上优先。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (41, 45, '职位描述\n1、负责服务端产品的业务项目测试；\n2、参与整个团队质量体系的搭建，包括但不限于：自动化测试、持续集成、上线系统等；\n3、线上问题追踪及分析；\n4、团队管理与项目方向把控。\n职位要求\n1、本科及以上学历，计算机相关专业毕业，2年以上工作经验；\n2、最少掌握一门高级语言，熟悉python优先；\n3、掌握网络相关基础知识， 包括TCP/IP协议， HTTP协议；\n4、熟悉web自动化测试，有独立定位问题的能力。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (42, 47, '职位描述\n1、负责字节跳动游戏的技术运营规划和运维工作，保障游戏服务处于高可用水平；\n2、负责分析和解决字节跳动游戏运营中遇到各类技术问题、运营风险及技术难点，优化业务流程、提升工作效率和服务质量；\n3、与发行等团队建立良好的合作沟通与信任关系，快速发现和响应用户需求，并持续跟进改善。\n职位要求\n1、计算机或相关专业本科及以上学历；\n2、3年以上工作经验，熟悉Linux操作系统，精通掌握Shell，熟悉常见数据库架构及SQL；\n3、具备Python或Golang开发能力及经验；\n4、熟悉常见云服务产品和相关最佳实践；\n5、有高可用服务运营产品架构实践、调优经验优先；\n6、有海量运维工作经验，能流畅使用英文口语交流优先；\n7、具有开源精神，有DEVOPS/运维开发管理经验者优先。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (43, 48, '职位描述\n1、负责维护私有化部署产品相关的稳定性提升、性能优化、可用性优化；\n2、负责开发和优化后台服务架构，构建高并发低延迟后台系统，解决性能瓶颈问题。\n职位要求\n1、统招本科及以上学历，计算机软件或相关专业；\n2、深入理解Linux系统，熟悉分布式系统的架构设计和运维设计；\n3、熟悉一门以上脚本语言(Python/Shell/Perl等)，熟悉一门以上开发语言（C/C++/Go/Java）；\n4、熟悉云计算知识，包括分布式存储，虚拟机，网络， 容器等；\n5、对可扩展性、稳定性、性能、质量有特别的执着，若有高可用、高性能 Web 实践经验更佳；\n6、掌握 Web 后端开发技术: 协议、架构、存储、缓存、搜索、安全、消息队列等\n7、具备很强的ownership, 良好的客户意识，善于团队协作，主动思考，自我驱动力强。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (44, 49, '职位职责：\n1、负责字节跳动全球骨干网络、数据中心网络、CDN、公有云网络的建设及7*24小时监控运维工作；\n2、负责网络相关设备的测试工作；\n3、参与字节跳动网络架构规划和设计。\n职位要求：\n1、有网络运维工作经验，互联网或运营商相关背景为佳；\n2、精通TCP/IP、OSPF、BGP等协议，熟悉大规模IDC及骨干网络架构；\n3、熟悉Cisco、华三、华为、Arista等主流网络厂商产品技术；\n4、具备良好的客户服务意识及团队协作精神；\n5、本科及以上学历。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (45, 50, '职位描述\n1、智能硬件产品需求分析，关键方案设计、器件选型等；\n2、智能硬件硬件开发，方案验证到产品开发、交付；\n3、智能硬件相关新技术预研、分析；\n4、产品开发关键问题攻关。\n职位要求\n1、熟悉智能硬件常用芯片平台、常用传感器等，5年以上智能硬件开发经验；\n2、有端到端智能硬件开发经历，从方案设计、器件选型、硬件开发设计交付等全流程开发经历；\n3、系统级方案设计验证能力，从事过机器人、无人机硬件系统开发的优先；\n4、良好的沟通能力，学习能力佳，敢于接受挑战，有创造性。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (46, 51, '职位描述\n1、负责一对一，一对多视音频通信教育场景服务的实施、包括软硬件的安装、调试及日常维护；\n2、负责解决客户通信过程中遇到的问题、主要应对技术层面的服务请求；\n3、负责实时课程的监控，问题排查；\n4、负责反馈，整理，分析IT问题事件，与研发团队紧密沟通配合，共同提升产品品质；\n5、负责领导安排的其他相关工作。\n职位要求\n1、了解常见网络问题及解决办法，熟悉消费级电脑硬件设备，熟练操作Windows和Mac OS，对熟练操作远程协助类工；\n2、本科学历以上，计算机相关专业优先考虑；\n3、沟通理解能力强，可以快速定位问题，并且给出相应处理办法；\n4、学习能力强，可以快速了解业务规则和产品功能使用方法；\n5 、良好的服务意识，面对客户优秀的沟通能力，增进客户满意度\n6、良好的办公软件使用能力。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (47, 52, '', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (48, 53, '职位描述\n1、负责安全产品/平台的运营工作，如WAF、HIDS等的规则配置、策略优化、报警处置；\n2、跟进安全漏洞闭环，能够独立协助业务修复安全漏洞，直至漏洞关闭；\n3、能够协助内/外部安全漏洞、情报应急响应处置，影响范围评定、利用复杂度分析、攻击溯源等。\n职位要求\n1、具备计算机、软件设计、信息安全等相关专业背景优先；\n2、一年以上相关工作经验，条件优秀者放宽至应届毕业生；\n- 参加过国内外知名赛事并取得优异成绩者，如国内外的CTF赛事；\n- 参加过护网行动，发表过优秀技术文章，有安全服务工作经验，满足其中之一者优先考虑；\n3、满足如下条件的任意一项或者多项：\n- 熟悉Android、iOS 平台安全性，熟悉移动APP常见安全问题及防护方案；\n- 熟悉Linux/Unix操作系统，熟悉常见命令的使用，熟悉常见的攻击和防护手段；\n- 熟悉TCP/IP或HTTP/HTTPS协议，熟悉针对网络协议的常见攻击和防护手段；\n- 熟悉常见的Web应用攻击和防护手段；\n- 能够编写PoC、Exp，熟悉Python、Go等语言；\n- 熟悉常见安全产品的防护原理及规则配置；\n4、有各种安全系统运维经验或安全事件处理经验优先考虑；\n5、有信息安全相关资质证书优先考虑，如CISSP、CISP等。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (49, 54, '职位描述\n1、负责部门所有业务系统的应用安全，保证应用安全性；\n2、负责例行安全检查、漏洞跟踪处理、解决方案制定；\n3、负责优化安全应急响应流程, 以及突发安全事件的应急响应；\n4、负责内部安全防御系统的策略维护及更新；\n5、负责最新的安全漏洞研究, 最新安全动态的跟踪与探索。\n职位要求\n1、熟悉企业级SaaS安全策略，对常见的安全漏洞 (Web、系统) 的原理、危害、利用方式及解决方案有深入的理解并有丰富的经验（有独立渗透测试经验或在各漏洞平台上报过漏洞者优先）；\n2、精通 Web 攻击方法, SQL 注入、XSS 攻击、命令注入、CSRF 攻击、上传漏洞、解析漏洞，能够自行跟踪新出的 Web 攻击方式及原理分析，熟悉常见脚本语言, 能够进行 Web 渗透测试, 恶意代码检测和分析；\n3、具备独立对应用进行黑盒、白盒安全测试以及 Web 漏洞挖掘能力；\n4、熟练掌握一门开发语言（如 Python、Golang 等）并可开发简单工具；\n5、对移动安全有所了解, 熟悉加固、反编译、漏洞挖掘及解决方案等。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (50, 55, '职位描述\n1、负责数据库的监控，备份，性能优化及故障处理等;\n2、数据库分库分表方案的设计、实施及数据迁移;\n3、负责根据项目需求设计并制定数据库解决方案;\n4、负责数据库中间件的相关测试、维护及管理工作;\n5、制定并不断完善数据库的运维规范、开发规范及安全规范；\n职位要求\n1、计算机相关专业本科及以上，有两年以上MySQL管理经验；\n2、熟悉MySQL数据库体系结构和工作原理；\n3、熟悉常见存储引擎的原理、特点以及主从复制原理和实践；\n4、熟悉目前常用的开源中间件解决方案，如Mycat，Atlas等；\n5、有一定的脚本语言编程能力，熟悉Shell、Perl、Python脚本语言中的一种或几种;\n6、有使用MongoDB、Redis的经验优先考虑；\n7、良好的沟通、协调能力，能在一定的压力下有效开展工作。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (51, 57, '', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (52, 58, '职位描述\n1、参与公司商业化SMB业务数据汇聚和采集ETL详细设计和开发工作；\n2、负责数据平台相关数据管理工作，如研发规范、质量规范、保障规范的制定与推动实施落地；\n3、负责数据分析需求的模型开发和实现；\n4、负责来自业务团队数据方面的研发需求。\n职位要求\n1、精通SQL语言，具备存储过程开发能力，能熟练进行SQL查询优化；\n2、熟悉Hive数据仓库设计，了解数据仓库模型及思想、维度建模思想，了解数据仓库、CDP者优先；\n3、熟悉Hadoop、Spark、Flink、Kafka等相关技术；\n4、熟练Python、Java中至少一种语言；\n5、熟悉Mysql、Nosql等常见数据库；\n6、具有良好服务意识，踏实，好学，较强的沟通能力，良好的团队协作精神，对海量数据处理与业务分析赋能有热情，会站在业务和产品角度综合考虑问题。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (53, 59, '职位描述\n1、负责字节跳动的用户产品线的数据仓库架构设计、建模和ETL开发；\n2、参与数据治理工作，提升数据易用性及数据质量，与数据工具团队紧密合作；\n3、理解并合理抽象业务需求，发挥数据价值，与业务团队紧密合作。\n职位要求\n1、精通数据仓库实施方法论、深入了解数据仓库体系，并支撑过实际业务场景；\n2、具备较强的编码能力，熟悉sql，python，hive，spark，kafka，storm中的多项，有至少TB以上级大数据处理经验；\n3、对数据敏感，认真细致，善于从数据中发现疑点；\n4、善于沟通，具备优秀的技术与业务结合能力。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (54, 60, '职位描述\n1、为大规模推荐系统设计和实现合理的离线数据架构；\n2、设计和实现灵活可扩展、稳定、高性能的存储系统和计算模型；\n3、生产系统的trouble-shooting，设计和实现必要的机制和工具保障生产系统整体运行的稳定性；\n4、打造业界领先的存储、计算等分布式系统，为海量数据和大规模业务系统提供可靠的基础设施；\n职位要求\n1、熟悉多项大数据领域的开源框架，e.g. Hadoop, Hive,Flink, FlinkSQL,Spark, Kafka, HBase, Redis, RocksDB, ElasticSearch etc.；\n3、熟悉Java、C++等编程语言;\n2、强悍的编码和 trouble shooting 能力；\n3、乐于挑战没有明显答案的问题，对新技术有强烈的学习热情;\n4、有PB级别数据处理经验加分。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (55, 61, '职位描述\n1、研究数据挖掘或统计学习领域的前沿技术，针对海量数据，构建和优化群体画像；\n2、参与风控、精准营销、个性化定价等模型建设和领域研究，提升产品效果；\n3、根据公司需要，对原始数据进行清理、甄别、归类和整合，并实现流程自动化。\n职位要求\n1、机器学习、数据挖掘相关方向硕士及以上学历或 2 年以上工作经验，对群体画像分层/推荐系统有经验者优先考虑；\n2、熟悉C/C++语言、Python、Java任意一种语言，较强的算法和数据结构功底；熟悉大规模数据挖掘、机器学习等相关技术, 熟悉Hadoop/Spark/Hive技术优先；\n3、良好的逻辑思维能力,优秀的分析和解决问题的能力,对挑战性问题充满激情；\n4、良好的团队合作精神,较强的沟通能力。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (56, 62, '职位描述\n1、部门数据管理。负责本部门数据收集与相关基础数据分析；\n2、数据看板日常运维。负责本部门相关数据看板的日常运维，例如：看板日常使用、相关优化建议收集，推动看板持续优化等；\n3、业务工作支持。完成业务部门安排的工作，例如：撰写月报/周报、完成管理流程梳理专项、完成业务流程梳理专项等；\n4、经分工作支持。支持经分相关专项工作，例如：部门经营指标制定与跟进，看清业务与组织专项支持（涉及本部相关部分即可）等。\n职位要求\n1、本科及以上学历，经济学、数学、统计学等理工科专业优先；\n2、1-3年数据分析同岗位工作经历；\n3、工作细致且有责任心，具备较好的沟通能力，具备优秀的数据敏感度；\n4、精通Excel，可熟练使用SQL、Python进行数据统计分析。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (57, 63, '职位描述\n1、掌握数据仓库体系架构、数据建模方法、数据治理等知识；\n2、对数据价值探索充满热情，较强的业务理解和抽象能力，能快速分析和理解问题；\n3、扎实的数据结构、数据库原理等基础知识，五年以上数据仓库建模经验；\n4、掌握大数据技术栈，包括Hadoop/Hive/Spark/ES/OLAP引擎等；\n5、思维逻辑清晰，良好的自驱力、沟通能力和解决问题能力；\n6、强烈的自驱力和责任感，面对复杂业务问题，可以从业务和技术多角度推进，最终达成目标；\n7、有关系图谱相关经验优先。\n职位要求\n1、本科及以上学历，计算机、数学、统计学等相关专业优先；\n2、良好的逻辑思维能力，能够从海量数据中发现关键特征；\n3、精通SQL，市场主流的BI工具开发设计，熟悉linux开发环境，熟悉C++和python语言，有优秀的编码与代码控制能力, 以及扎实的数据结构和算法功底；\n4、精通常见的机器学习算法（如逻辑回归、SVM、神经网络、决策树、贝叶斯等），有丰富的实际建模和调参经验；\n5、熟悉基于自然语言处理的文本相关性算法、特征提取等技术，至少一至两个项目的经验。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (58, 64, '职位描述\n1、负责研究软件工程及测试领域的前沿学术问题，并且结合业务场景进行效率提升；\n2、负责推动智能化测试技术落地到今日头条产品。\n职位要求\n1、计算机、软件工程、人工智能、模式识别等相关专业硕士及以上学位；\n2、有以下领域之一的研究积累：\n机器学习：深度学习、大规模优化算法、概率统计模型、强化学习等；\n软件工程：程序分析、组合测试、测试生成；\n机器视觉：场景理解、目标检测与识别；\n数据挖掘、社交网络分析、时间序列分析、知识图谱；\n3、熟悉至少一种编程语言，有扎实的编程基础、良好的编程风格和工作习惯。\n加分项：\n1、具备良好的英文听说读写能力；\n2、在顶级会议(ICSE/ICST/CVPR/ICML/KDD)上发表过论文者优先。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
