INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (64, 71, '职位描述\n1、负责在工作现场进行软件的安装部署、配置和调试等工作；\n2、负责对客户的使用、操作以及维护等相关培训、进行项目验收等工作；\n3、负责软件系统的维护工作、解决系统使用中客户碰到的问题；\n4、负责公司产品实施阶段的测试及产品 BUG 的提交，与研发沟通解决相关问题；\n5、收集与分析客户需求，并定期为客户进行系统巡检。\n职位要求\n1、具有两年以上大型 IT 系统实施和运维相关经验；\n2、熟悉 Linux/Unix 系统、网络、硬件等相关知识，具有很强的 Troubleshooting 能力；\n3、能够完成 Hadoop、Nginx、Redis、MySQL等开源系统的部署；\n4、至少使用过一种自动化部署工具：Ansible、Saltstack、Chef、Puppet、Terraform 等；\n5、至少熟悉一种脚本语言：Shell、Python 等；\n6、对云平台有一定的了解，有 Aliyun/AWS 等使用经验者优先；\n7、熟悉 Docker、K8S/Istio 等容器技术和工具者优先；\n8、具有良好的沟通、组织与协调的能力，有一定的抗压能力，能够接受出差。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (65, 72, '1、 本科以上学历，5年以上工作经验，其中3年以上软件需求分析经验，\n2、 熟悉需求调研方法，较强的业务流程及业务模型分析设计能力；善于控制需求，进行版本范围及项目范围管理；丰富的客户（及内部）沟通经验，能快速把握需求的核心要点；\n3、 熟悉软件工程理论，掌握软件需求获取与分析方法，并有测试验收经验，熟悉Axure、思维导向图使用者优先；\n4、 有较强的文档编写能力；熟悉CMM文档规范者优先；\n5、 良好的英语读写水平，有独立查阅英文专业资料的能力；\n6、 需有较强的团队协作精神，有效的沟通技巧，在团队协作中具有精炼思维和解决复杂问题的能力，具备良好的学习能力，责任心强，能够承受较大的工作压力。\n\n岗位职责：\n\n1. 定期与客户沟通，收集并分析业务需求，输出初步需求实现方案，与客户确认方案；\n2.进行需求拆分和细分，编写详细需求说明书，对团队成员进行需求解说；\n3.需求开发完成后，进行验收测试和UAT演示，并参与系统功能验收工作及用户手册、新增产品功能培训资料的编写；\n4.参与整个产品开发流程，与开发测试团队一起保证最终产品发版。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (66, 74, '', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (67, 75, '职位描述\n1、根据产品需求负责单片机嵌入式代码的开发，根据业务流程设计总体软件设计框架，能根据框架应用代码实现；\n2、嵌入式C语言开发相关功能模块；\n3、进行嵌入式产品的数据采集硬件开发，保证产品的可靠性和安全性；\n4、带领软件工程师完成软硬件的衔接及代码检视工作，对现有软件进行优化。\n职位要求\n1、通讯、电子、无线电、仪器仪表等相关专业，3年以上工作经验。本科及以上学历；\n2、熟悉嵌入式开发流程，精通C语言编程，熟悉常用的嵌入式开发工具和开发环境，例如Keil或IAR，能独立完成代码调测实现产品功能；\n3、至少熟悉两种微处理器平台的编码：如STM8，STM32，ATMage8，ATMage32，飞思卡尔，PIC等单片机中的两种；熟练运用库函数开发实际产品；\n4、熟悉短距离通讯知识，如zigbee ，蓝牙，wifi等，了解相关通讯协议并实现设计需求；\n5、接触过微操作系统，能做常见微操作系统，文件系统，通讯协议的移植和开发：例如uCOS，FATFS，Z-stack协议栈等，熟悉物联网相关技术（WiFi/NB-IoT/LoRa/Zigbee/GPRS），熟练使用单片机（如MSP430）或ARM Cortex系列处理器（如STM32、LPC系列等）；\n6、有一定英语阅读能力, 能够读懂芯片数据手册；\n7、加分项： 熟悉使用PROTEL/AD9等绘图软件，熟悉基本的PCBA制作及工艺流程，具备硬件工程师专业知识，精通模拟及数字电路，有较强的分析及解决问题的能力，有2年以上电子产品硬件设计经验。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (68, 76, '职位描述\n1、主导IT数据中心和办公区基础架构自动化运维体系规划和建设；\n2、根据需求完成日志分析、监控、告警、CMDB等运维平台的二次开发工作；\n3、负责基础架构各运维平台的需求、数据、API接口对接工作；\n4、完善并不断丰富办基础架构自动化运维相关技术、方法和流程，不断提升网络和IDC的可靠性和人员效率。\n职位要求\n1、两年以上相关工作经验\n2、熟练使用Go、Python语言进行后端开发；\n3、熟练HTTP API开发，有过Django/Flask的框架开发经验者优先；\n4、熟练使用 Linux 系统常用命令，掌握 shell/Python脚本编写；\n5、熟悉业内常用的监控解决方案， 如ELK、Zabbix、Prometheus等；\n6、有运维相关流程、工具建设的能力，具备识别共性/重复性问题并转化为开发需求，实现通用性的运维平台或服务的能力；\n7、具备快速学习掌握新知识的能力，良好的交付意识和沟通技巧。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
