INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (71, 79, '职位描述\n1、Android Audio HAL 层开发；\n2、Android/Linux 音频设备驱动开发；\n3、音频问题分析调试。\n职位要求\n1、计算机及相关专业背景；\n2、扎实的 C/C++及Java语言基础，良好的编码能力；\n3、3年以上Android 音频子系统开发经验，熟练掌握AudioService、AudioFlinger、AudioPolicy、AudioHAL等音频模块工作机制；\n4、丰富的Android Audio HAL和驱动功能开发经验和调试经验优先；\n5、丰富的多媒体开发经验优先；\n6、较强的独立思考能力和团队协作能力，吃苦耐劳，责任心强。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (72, 80, '职位描述\n1、负责自建呼叫中心的项目管理工作，包括时间、范围、质量、风险等；根据项目过程中产生的问题及时调整，保证项目按期保质保量完成；\n2、负责呼叫中心的系统集成工作，第一时间发现线上问题，协助分析、定位、并解决问题；\n3、负责运营商及代理商的资源落地；\n4、负责当地坐席区的平台技术支持；\n5、负责新业务需求响应及集成工作；\n6、负责提供合理的语音落地解决方案，保证需求的实现；\n7、负责自研平台或产品平台的配置管理及维护。\n职位要求\n1、熟悉计算机网络和电信网络的相关技术，3年以上项目管理经验优先；\n2、熟悉呼叫中心（PBX、CTI、IVR等）相关的技术，熟悉至少一款主流厂商（AVAYA、GENESYS、HUAWEI、CISCO等）的产品；\n3、掌握熟悉H323、SIP协议，熟悉网络相关知识，熟悉TCP/IP协议，熟悉软交换相关技术；\n4、熟悉linux操作系统，熟悉Mysql/ oracle数据库；\n5、熟悉国内外语音网关（Audiocodes、Dialogic、Sonus、迅时等）；\n6、熟悉WireShark抓包工作，根据语音数据包，能够从信令和媒体两方面分析问题；\n7、有中、大型呼叫中心（1000坐席以上）实施、集成和维护经验者优先；\n8、有IVR流程开发经验者优先；\n9、有项目管理认证PMP以及系统集成认证证书优先；\n10、具备良好的沟通协调能力，作风严谨，责任心强；\n11、具有和运营商谈判经验及运营商故障定位解决问题经验优先；\n12、有很强的责任感和学习能力，能够承受一定压力；\n13、具备较强的交流、沟通和表达能力，以及文档编写能力。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (73, 81, '工作职责:\n1. 负责4G/5G无线基站产品中物理层协议方向的FPGA方案设计工作；\n2. 负责4G/5G无线基站产品中物理层协议方向的FPGA功能模块的编码、仿真、调试工作；\n3. 负责相关设计文档、接口文档及仿真测试文档的编写；\n4. 负责RTL代码及仿真测试向量的编写；\n5. 负责系统相关的FPGA问题分析和定位；\n6. 负责4G/5G相关特性需求分析工作；\n\n任职资格:\n1. 通信工程、电子信息工程、信号与信息处理、通信与信息系统，自动控制、微电子、计算机等相关专业，统招硕士及以上学历毕业，三年以上相关工作经历；\n2. 熟悉FPGA设计流程，熟练掌握Verilog HDL和VHDL设计语言，具备良好的编码风格；\n3. 熟悉Xilinx或Intel主流FPGA器件和相关EDA工具，具备较丰富的板级和系统级调试技能；\n4. 熟悉Matlab工具，可用Matlab搭建仿真模型及分析问题；\n5. 熟悉LTE/NR物理层协议，包括High-PHY比特级处理（PDSCH/PUSCH/PRACH等信道）和Low-PHY符号级处理（IFFT/FFT/相位补偿）等设计经验；\n6. 熟悉LTE/NR物理层信道处理流程，熟悉小区合并算法和实现；\n7. 熟悉LTE及NR系统架构，具备4G/5G基带单元（BBU）FPGA设计经验者优先。掌握无线通信基本原理，熟悉5G NR信道编译码和相关FPGA设计经验者优先；\n8. 工作积极主动，善于学习挖掘，良好的分析与解决问题能力，团队合作精神；', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (74, 82, '学历、专业要求：本科及以上学历，通信、电子、计算机类相关专业\n\n岗位职责：\n(1)从事软件无线电开发工作；\n(2)负责各类无线通信协议DSP协议软件、物理层算法开发、优化、测试和维护；\n(3)负责DSP软件的联合调试及整体优化工作；\n(4)负责TI多核芯片的DSP核和ARM核底层驱动程序的开发、调试、维护、优化和技术支持工作。\n\n任职要求：\n(1)熟练掌握C和Matlab等语言；\n(2)了解TI DSP编程，了解至少一款TI DSP芯片开发优先；\n(3)了解无线通信系统，具有LTE空口协议或者软件无线电开发经验或课题研究经验者优先；\n(4)CET-4以上，能熟练阅读专业英文资料', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (75, 83, '位职责：\n1、开发基于网络的嵌入式视频系统，包括身份认证、数据加密等。\n2、参与ARM等嵌入式平台系统的开发、测试与优化。\n3、完成设计文档、开发文档、测设文档的编写。\n·        任职要求：\n1、统招本科及以上学历，计算机软件/通信/电子等相关专业；\n2、熟练使用C/C++语言编程，算法基础扎实；\n3、熟悉嵌入式Linux系统；\n4、良好的协作能力与沟通能力，责任心强，敢于创新，有团队合作精神；\n5、有信息安全基础知识者优先', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (76, 84, '职位描述：\n1.根据原理图进行PCB设计及修改。\n2.生成PCB生产数据及SMT资料。\n3.制作和维护PCB封装库。\n职位要求：\n1.熟悉PCB绘制流程，熟练输出GERBER文件，及生产文件。\n2.熟练使用Power PCB(PADS),可建立和维护PCB封装库。\n3.专科学历以上，1-3年工作经验。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (77, 85, '1、负责智能手机射频电路系统的设计与调试；\n2、负责射频关键器件的评估与选型；\n3、负责试产，量产的生产支持工作；\n4、负责手机产品CTA，CE等认证测试支持;\n5、负责新技术调研与评估；\n任职资格：\n1、电子相关专业毕业；\n2、具有扎实的电磁场微波理论基础；熟悉LTE，WCDMA，GSM，WiFi，GPS等无线通信协议；\n3，具有较强的动手能力，电路理论及分析能力较强。\n4、熟悉综测仪，频谱仪，矢量网络分析仪等射频仪表的使用；\n5、掌握常用的EDA设计工具，熟练运用射频仿真工具进行电路分析与设计，有实际射频仿真设计者优先', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (78, 87, '职位描述\n1、负责容器云平台及 AI 云平台等前端组件和系统的设计、开发、维护工作；\n职位要求\n1、1-3 年或以上前端开发经验；\n2、了解计算机网络原理，HTTP 协议，基本的浏览器渲染和网络传输过程；\n3、熟练使用 React 技术栈或至少一类前端框架（Angular/Vue.js 等）且具备快速转向 React 的能力；\n4、熟悉 Node.js，有相关开发经验；\n5、熟悉 Webpack、Gulp 等至少一种构建工具；\n6、熟练使用 Git，了解 Linux 常用操作；\n7、优秀的沟通协作能力、分析解决问题能力和学习能力；\n8、有良好的测试习惯以保证高质量软件的产出，快速定位和调试问题的能力。\n\n【加分项】\n1、有可视化、工程化等前端领域工作经验者优先；\n2、熟悉 GraphQL 等技术栈优先；\n3、熟悉 Docker、Kubernetes 及相关云原生系统者优先。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (79, 88, '职位描述\n1、负责公司移动端产品设计和研发；\n2、与产品经理、设计师、后端工程师紧密配合，负责公司各产品易用性改进、界面技术优化和网站性能优化；\n3、Web前沿技术调研。\n职位要求\n1、熟悉W3C标准，对表现与数据分离、Web语义化等有较为深刻的理解；\n2、精通HTML/XHTML、CSS等网页制作技术，熟悉页面架构和布局；\n3、精通JavaScript、Ajax等Web开发技术。有丰富的VUE/React开发经验，并对其原理理有深刻的理解；\n4、具备工程化的前端思维，具备较好的问题分析与解决能力；\n5、思路清晰，具备良好的沟通能力和团队协作精神，善于学习、总结，乐于分享。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
