INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (84, 94, '工作内容\n1. 4G、5G基站开发\n2.物理层、MAC层开发\n岗位要求：\n1.本科、 硕士以上学历，计算机通信相关专业。\n2. 5年以上通信开发经验；\n3. 熟悉基本通信知识；熟悉3Gpp协议；熟悉物理层，\n4. 熟悉4G、5G一些关键技术，比如MIMO，Beam forming等，有MAC、PHY研究或者开发背景；\n5. 英文良好，能够进行基本的工作读写听说', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (85, 95, '岗位职责:\n1.负责数据通信设备的测试验证工作，包括交换机、路由器、宽带网络接入服务器等数据通信技术和设备的测试验证工作及进网测试。\n2.负责网关、汇聚分流、负载均衡等相关数据通信设备的委托测试工作。\n3.参与数据通信设备等相关新技术研究工作，参与相关国际国内标准化研究制定工作。\n任职资格:\n1.对于通信基本理论、路由交换设备等技术发展水平及趋势、以及现有网络应用情况要有较深入的掌握和理解。\n2.掌握TCP/IP、IPv6以及各种路由协议，同时熟悉相关设备及网络的测试验证方法，负责或参与过相关的测试验证项目。\n3.熟悉和掌握数据通信相关的各种仪器仪表的操作和功能，同时对于主流数通设备商（如华为、思科等）的设备有较深入的了解。\n4.对于数据通信领域新技术的研究焦点及方法、技术发展趋势、以及国内外相关技术标准进展及制定有较深入的了解。\n5.熟悉计算机操作和应用，熟练使用Word, Excel, PowerPoint, Outlook等办公软件；具有较强的英语听说读写能力。\n另：责任心强，注重团队沟通和合作，对于新技术学习和适应能力强；工作态度积极主动，认真踏实，能严格遵守国家及单位的各项规章制度。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (86, 96, '岗位要求：\n1、 具备敬业、攻关、严谨、友好等良好品质；\n2、 负责软件无线电项目的方案设计、编程开发、程序优化以及配合\n测试；\n任职要求：\n1、 本科以上学历，通信、信号处理相关专业，具备扎实的通信信号处理理论基础，熟悉软件无线电技术体系架构和软件设计流程。三年以上工作阅历，具有SDR开发经验者优先录取；\n2、 具备优秀的C/C++/phthon等语言的编写能力；\n3、 具备阅读、移植、应用相关开源代码的能力，具有产品或项目\n实际开发经验者或具备AD9361芯片开发经验者优先录用。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (87, 97, '岗位职责：\n1、管理和维护交换机、防火墙、网闸、VPN等网络设备，定期对网络拓扑图和台账信息进行更新；\n2、日常网络变更的需求分析、讨论、风险评估、编写方案脚本、实施并进行业务验证。对设备进行版本升级及例行重启，设备配置的合规检查及优化等；\n3、业务系统的施工和网络割接等，及时恢复网络的正常运行；\n4、负责组织网络相关技能培训，网络相关的应急预案的制定修订，并定期组织应急演练；\n5、负责设备健康检查报告的编写与版本修订工作，运维技术方案、故障分析报告的编写；\n6、完成重大会议活动期间的保障工作，对设备出现的故障，及时处理、修复。\n\n任职资格：\n1、精通路由器、交换机、防火墙等技术，熟练掌握思科、H3C、华为等网络设备安装、调试及日常运维故障排查命令；\n2、具有相当丰富的网络故障处理经验，遇到重大事故有独立解决或寻求其他解决途径的能力和经验；具有不少于3年以上的网络维护工作经验；\n3、熟悉TCP/IP协议，熟悉路由交换等基础网络技术；\n4、熟悉可靠性技术，如IRF、BFD、NQA、ECMP、link-aggragate；\n5、熟悉基本二层交换技术，如STP\\RSTP\\MSTP、ARP、MAC、二层数据包转发；\n6、熟悉基本三层路由技术，如静态路由、OSPF、BGP、MPLS；\n7、持有CCIE、CISSP、HCIE、H3CIE证书优先；\n8、有大型项目经验优先。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
