INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (89, 99, '岗位职责：\n1、负责系统集成项目专网的网络的规划和设计；\n2、 负责客户传输设备的扩容、升级及维护方案的编写及实施；\n3、 负责客户传输设备的设备日常故障处理、巡检及技术咨询；\n4、 负责部分传输设备类项目的售前支持；\n\n岗位要求：\n1、 掌握包括SDH、OSN、波分、等设备的督导、开通/调测、升级、割接、业务开通等；\n2、同时具备传输设备经验者优先;\n3、工作积极进取、有开拓能力、创新精神，拥有强烈的团队精神和合作精神\n4、有公安及政府网络运维经验者优先；', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (90, 100, '岗位职责：\n\n1.根据项目需求，按照开发流程以及项目进度，独立完成测控及数据链系统相关射频部分的评估与设计，射频电子元器件评估与选型，射频原理图设计和PCB设计以及天线评估；\n\n2.独立完成射频调试与测试工作，解决研发和量产阶段的射频问题;\n\n3.撰写相关技术文档，支持测试认证等；\n\n4.协助其它相关部门工作，产线支持和失效分析等。\n\n任职要求：\n\n1.本科或以上学历,电磁场、微波、通讯技术相关专业；\n\n2年以上射频研发设计工作经验;熟悉无线数字通信系统架构，熟悉射频元器件设计原理，对射频模块及数字通信有深入的了解；\n\n3.熟悉各类高频电子元器件，能够根据需求评估选型；\n\n4.有较强的独立从事电路设计及分析问题的能力；\n\n5.熟悉频谱仪、网络分析仪等射频仪表;\n\n6.具备基本的电磁兼容性知识，有EMI、EMC设计经验者优先；\n\n7.具备基本的天线知识，有天线设计和测试经验优先;\n\n8.具有较好的英文阅读能力;\n\n9.良好的逻辑思维能力和理解能力，富有团队合作精神,工作细致,责任心强。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (91, 101, '岗位职责;\n1.负责通信电源的调试安装和测试；\n2.负责通信电源产品的售前技术支持；\n3.负责通信电源产品的设计改进；\n4.负责通信电源产品的配套集成；\n任职要求：\n1.通信或电子类相关专业大专以上学历；\n2.具有较全面的相关专业基础理论知识和专业技术知识；\n3.具有良好的团队精神和沟通技巧，认真负责；', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (92, 102, '岗位职责：\n1、负责制定低轨卫星移动通信协议标准；\n2、负责跟踪与研究ITU、3GPP等发布的地面移动通信系统前沿协议标准；\n3、负责跟踪与研究sat5G、ITU等最新卫星移动通信协议标准；\n4、负责标准提案文件编写；\n5、负责标准制定工作方面的外部交流、协调。\n\n任职要求：\n1、通信、信息工程相关专业毕业；\n2、掌握移动通信基本理论与卫星通信原理；\n3、熟悉GSM/WCDMA/LTE无线空口或上层协议；\n4、了解地面基站、核心网等网元基本构成与接口；\n5、从事过3GPP等标准制定，有参与无线通信产品开发经验。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (93, 103, '未找到', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (94, 104, '岗位职责:\n1. 按照项目计划实施军工通信系统验证平台/试验网项目，包括相关工程施工协调、现场管理，对工程项目的进度、质量、覆盖效果进行跟踪管控；\n2. 组织通信系统相关内外场试验；\n3. 配合完成5G通信系统集成类解决方案编写及售前咨询服务；\n4. 完成项目的其他事务性工作，落实领导交办的其他任务。\n\n任职资格:\n1. 本科及以上学历，通信、信息、计算机和网络等相关专业；\n2. 吃苦耐劳，具备良好的沟通能力，并且独立完成客户沟通及任务分解；\n3. 熟悉通信施工和通信网络，常规网络和设备指标及建设方案；\n4. 有通信设备施工项目管理经验或运营商监理管理经验优先；\n5. 具备军工科研项目经验优先，党员优先。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (95, 105, '岗位职责：\n1、负责基于VoLTE、5G、彩铃的创新产品规划、涉及、开发和交付；\n2、负责创新产品问题的排查、分析、处理以及协调；\n3、完后领导交办的其他事项。\n任职条件：\n1、通信工程相关专业毕业，2年及以上工作经验；\n3、熟悉基本通信原理、理解各个网元间的运行机制和工作原理；\n3、有VoLTE或5G核心网、无线网工作经验，熟悉核心网、5G网络sip信令协议等交互逻辑，IMS网络结构、熟悉SIP信令注册/呼叫流程和相关的3GPP规范；\n4、有较好的项目推动能力及分析解决问题能力、故障定位及处理能力；\n5、熟悉5G通信技术的优先。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (96, 106, '岗位职责:\n1、负责5G等移动通信网络设备的安全相关测试；\n2、负责IMS等电信网核心网设备的安全测试；\n3、负责物联网相关设备的安全测试；\n4、负责通信网数据检查及分析；\n5、负责或参与相关通信技术标准的制定。\n6、参与国家科研项目的实施。\n任职资格:\n1、熟悉移动通信网络架构、技术、协议、业务等：\n2、熟悉移动互联网、物联网、云计算、大数据等新技术新业务；\n3、熟悉网络攻防、漏洞扫描、威胁情报分析等技术；\n4、熟悉协议分析等技术；\n5、有实际黑盒测试、网络攻防测试、漏洞扫描测试经验者优先。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (97, 107, '岗位要求：\n1.  具有扎实的电子技术理论基础知识，熟练掌握数字电路、模拟电路知识，熟悉常用电子元器件的性能原理，物联网技术原理及相关技术趋势；\n2.  熟悉智能仪表、传感器、IO模块等各类自动化设备的通信、调试以及数据采集传输方案；\n3.  熟悉LoRa、NB-IoT、4G、RS485、Modbus 、M-bus等通讯协议及通信技术；\n岗位职责：\n1.  完成工业站房数据远程传输工程；\n2.  优化远程数据传输方案；\n3.  完成测试及故障排除工作。\n工作地址', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (98, 108, '岗位职责：\n光传输仿真\n1. 负责激光通信载荷的总体设计与技术协调，提出激光通信载荷的技术要求、方案设计\n2. 负责通信载荷单机研制流程中的跟产测试等。协助完成激光实验室建设等。\n\n任职要求：\n光学工程、光信息科学与技术等，有光路设计、激光通信相关工作经验等相关专业', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (99, 109, '职位详情:\n1.负责产品安装、维护、调试；\n2.给客户提供技术交流，产品培训；\n3.配合市场解决项目中出现的技术问题，产品技术交流；\n4.负责标书技术部分制作及投标有关事宜；\n5.负责故障维修设备的取送管理；\n6.定时到机房现场进行巡查；\n7.跟踪公司工程项目施工；\n8.完成领导交代的其他事项。\n\n通信专业优先，熟悉光传输，数通设备，SDH优先', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (100, 110, '职位描述\n1、负责设计对光传输网络及数据中心光链路性能运营有关键作用的指标；\n2、定义和设计数据中心光传输，光互联所用主要硬件标准及规格；\n3、负责光网络硬件从设计，开发到运营等端到端的系统性工作，输出优化方案，同时独立领导硬件产品研发工作；\n4、同时利用大数据分析技术对光网络和光链路进行优化并进行故障预测和预防；\n5、对下一代数据中心光网络硬件进行完整和系统性规划并执行。\n\n\n任职要求\n1、五年及以上的光网络相关领域工作经验，硕士及以上学历；\n2、熟悉并使用过光学仿真软件，光学指标分析软件，例如Zmax，Rsoft等；\n3、熟悉IEEE802.3等行业标准，有行业标准参与及制定经验者优先；\n4、对光模块，芯片，高速连接器，光纤及无源组件等产业链比较熟悉，产业资源有较强把握；\n5、熟悉相干光传输系统及网络硬件者优先；\n6、具有良好的沟通能力，思维缜密，逻辑性强，具有挑战精神和前瞻性，良好的团队协作精神；\n7、 良好的书面和口头表达能力，较高的文档撰写水平；', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (101, 112, '岗位职责：\n1. 负责激光工具，手持仪器、智能家居等产品电子设计；\n2. 器件选型,原理图、PCB设计，BOM技术文档编写；\n3. 嵌入式软件、MCU编程（C语言）及调试；\n4. 协助解决产品在调试、量产和应用过程中相关的问题；\n5. 跟踪技术发展及市场需求，为新产品开发提出合理建议。\n\n任职要求：\n1.本科及以上学历，电子、计算机、自动化、软件等相关专业；\n2.具备2年以上电子产品软件或硬件开发相关工作经验；\n3.熟悉掌握硬件原理图、PCB设计工具，熟练使用示波器、频谱仪、信号发生器等调试仪器，能制定硬件测试标准和用例；\n4.具有开关电源,MCU外围电路设计经验，能独立进行器件选型和设计；\n5.熟悉C语言编程，至少有一种以上MCU开发或嵌入式开发经验，能独立调试软体；\n6.英文能力良好，能读懂器件的英文规格书；\n7.责任心强，有上进心，有团队合作精神；\n8.有激光或智能产品开发经验者优先。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (102, 113, '岗位职责：\n１.负责产品自动控制系统设计；\n２.负责PLC程序编制；\n３.负责电气原理图、接线图、布局图设计及所需电气元件选型；\n４.负责低压电气设备选型、测试；\n５.负责相关电气技术文件编写和整理；\n６.负责电气装配、测试和改进，解决电气故障，提出改进措施；\n\n任职要求：\n１.电子、电气或自控相关专业专科及以上学历，有低压电气设计经验；\n２.熟悉电气布线、熟悉常用低压电气设备的性能和参数，能设计电气原理图；\n３.熟练应用CAD等设计软件，并根据产品或项目要求进行相关设计；\n４.熟悉电气控制设备相关标准，熟悉常见PLC、变频器、HMI编程与调试；\n５.工作主动，有责任心，有良好的学习能力、沟通能力和团队协作精神；\n６.有较强的动手能力，有吃苦耐劳精神；\n7.身体健康，能胜任出差。\n8. 有电工证/高级电工证者优先', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (103, 114, '岗位职责：\n1.负责嵌入式产品软件代码编写和产品功能调试。\n2.编写项目相关的技术文档。\n3.参与新产品和新项目系统架构设计规划和新产品方案设计。\n4.负责对SDK开发包的使用进行客户支持。\n5.负责项目完成以后的代码维护等工作。\n\n任职要求：\n1.本科及以上学历，计算机、电子、通信、自动控制等相关专业毕业，最好有2年以上相关工作经验。\n2.熟悉嵌入式linux系统的C语言开发，熟悉常用嵌入式软件开发工具。\n3.熟悉Windows、Linux多媒体应用程序开发优先；\n4.具备阅读英文技术资料的能力。\n5.具有上进心，有较强的自学习能力。\n6.工作认真负责、有较强的敬业精神，能承受工作中的压力。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (104, 115, '岗位职责\n1、配合产品经理，机械设计工程师完成项目的电气设计任务，包括绘制电气原理图、电气元器件选型；\n2、负责自动化设备项目中PLC，HMI等软件开发、现场调试等；\n3、将设计导入设备对所开发装备进行持续在线优化调试，并编写操作使用手册、技术培训手册等相关文件资料。\n4、了解行业内的新设备、程序设计等，对现有设备提出改善建议；提升设备整体技术水平，可以进行标准文档制定，输出培训；\n5、可完成供应商电气设计审核，能力鉴定；\n6、及时准确的完成上级主管安排的其他工作。\n\n岗位基本需求\n1、本科以上学历，电气或自动化相关专业；\n2、3年以上非标自动化电气设计工作经验；\n3、可以独立进行电气设计，绘制电气原理图，熟练EPLAN P8绘制电气原理图；\n4、具有基本的机械相关的知识，可以完成常用电气设备的选型及组装；\n5、精通SIEMENS、Rockwell、OMRON等PLC、HMI软件编程、调试；\n6、精通变频器、伺服控制系统的使用；\n7、具有良好的技术创新与研究能力，有良好的职业素质、工作责任心且具有团队合作精神。\n\n具备以下者优先\n有C语言或其他计算机语言编程知识者优先；\n有机械臂应用开发经验优先；\n有食品机械设计，食品工厂MES系统主导设计者优先；\n有餐饮自动化设备管理经验者优先。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (105, 117, '', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (106, 118, '经验：3年以上三维研发工作经验，1年研发团队管理经验。\n主要职责：\n² 负责编制三维引擎系统设计、技术路线方案；\n² 负责编写三维引擎核心代码、bug修复；\n² 负责产品研发进度、质量、研发环境管理；\n² 负责向营销团队提供技术支持；\n知识技能：\n² 至少熟悉一种C/C++/JavaScript编程；\n² 熟悉图形学算法，掌握OpenGL渲染流程；\n² 熟悉OpenGL/OpenGLES/WebGL图形程序开发；\n² 了解LOD原理；\n² 熟悉RESTful API接口开发；\n² 有研发团队管理经验。\n素质：\n² 有较强的自学能力，能通过持续学习完善自身；\n² 良好的沟通、表达能力；\n² 有责任心、上进心和自我驱动力；\n² 良好的职业道德和职业操守、责任感和事业心；', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (107, 119, '职责：\n1.高度理解公司的发展战略，全面负责公司各平台系统的技术方向研究和总体规划，全面负责公司技术层面的所有管理工作；\n2.带领研发中心团队，实现产品开发，上线，维护工作高质量顺利执行，同时主导公司大数据和云平台的规划设计，技术实现和稳定运行；\n3.主导制定并持续优化研发工作流程和规范，保证高效率、高质量的技术产出，促进技术成功的沉淀和共享，确保技术成果持续有效性；\n4.主导产品优化和升级，通过技术和产品推动项目发展，为公司业务发展提供动力；\n5、负责技术团队的招聘、建设、培养和关怀，提升团队的工作质量、效率和技术能力，优化项目人员结构，明确职责，定期进行技术培训。\n任职要求：\n1、211、985或双一流院校本科及以上学历，计算机、软件工程相关专业；\n2、年龄35岁左右，条件优秀者可放宽；\n3、具备JAVA开发背景，产品设计理念，有架构师开发经验或者大数据产品开发经验优先；\n4、具备较强的分析能力、逻辑思维能力和开放式思维能力；\n具备中型规模以上的软件公司管理经验。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (108, 120, '职责：主要负责业务功能测试\n要求：\n（1）熟悉开发测试流程，有至少1年测试管理经验，至少3年软件测试经验\n（2）掌握自动化测试，包括不限于接口自动化、服务端性能测试等，熟悉postman、jemter等工具\n（3）掌握至少一门编程语言：python、java等\n（4）有较好的内外部沟通、协调能力', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (109, 121, '岗位职责：\n1、负责主导行业中后台业务的系统架构及研发，参与制定业务的技术发展方向以及整体的架构设计\n2、具备专家级的技术能力与分布式系统分析、设计、架构能力，精通互联网分布式系统架构\n3、具备对工作流程的塑造和改造的能力，从业务、用户和技术出发，实现面向未来趋势的组件化产品中后台的系统规划、设计和落地\n4、带领技术预研和技术难点攻关，保障平台高可用、高稳定、和可扩展性\n任职资格：\n1、具备3年以上大厂架构经验以及2年以上团队管理经验，主导过大规模系统的架构设计。\n2、精通Java 微服务技术体系，有过成功实施经验\n3、精通 Web 技术并能持续关注Web技术，深刻理解前后端分离技术，掌握动效、webassembly 等技术\n4、理解可视化编程\n5、有很强的推动力、抗压力强，能拿结果，具备优秀的沟通合作、多部门跨团队协调能力\n工作地址', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (110, 122, '职责描述：\n1、参与公司战略讨论，负责技术产品整体发展方向，负责团队目标和工作计划的制定和执行，确保目标高效达成；\n2、全面负责产品及技术平台的技术架构和实施，负责产品技术团队建设和管理，注重人才培养和营造创新的研发文化；\n3、负责组织并指导产品技术团队在整体架构下开展产品设计、系统研发、上线前的测试工作，协调项目开发或实施的各个环节，把握项目的整体进度；\n4、负责研究系统业务技术解决方案，主导版本迭代的重大决策，准确的将业务需求转化为设计需求，形成系统架构设计；\n5、积极探索新技术在公司产品上的应用，对公司未来技术走向提出重要建议。\n任职要求：\n1、全日制本科及以上学历，8年以上产品技术研发经验，3年以上互联网公司产品技术总监管理经验，有大厂背景同时也经历过创业公司产品技术从0到1或者从1到10的革新变化者优先；\n2、有深厚的技术功底并精通高并发系统的架构设计、系统分析、软件实现、性能优化及系统安全，有大型电商或平台产品研发经验；\n3、敏锐的公司产品相关行业技术发展趋势把握能力，对新技术具有很强的敏感度，有强烈的新技术研究与探索欲望，碰到技术难题会兴奋者优先；\n4、有丰富的项目管理经验，良好的沟通能力、技术培训能力、协调能力和团队合作精神，善于与非技术人员进行技术问题沟通。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (111, 123, '职位描述\n1、负责公司私有云运维团队建设及运维体系建设，制定并不断优化各项工作流程，完善公司运维管理规范，保障运维质量；\n2、深入了解公司各项业务系统，建立运维知识体系，提高团队技术能力，缩短解决问题时间，提高客户满意度；\n3、完善现有各项运维工具，提高自动化程度，并不断探索新的技术方向、持续改进运维工作效率，降低成成本；\n4、全面管理运维工作，包括客户问题的接收和解决、突发事件处理，环境变更和升级、环境定期巡检等；\n5、不断探索和研究新的运维技术方向、运维工具，改进公司的运维管理能力；', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (112, 124, '岗位职责\n1、负责参与未来大学整体规划；\n2、负责管理未来大学产品的核心技术，聚焦教育/科技社区，基于自主研发建立新的大数据和云平台；\n3、根据公司战略目标及产品规划，统筹相关产品设计，产品设计流程的规范化管理与过程管控；\n4、把控公司技术开发、产品设计的风险，解决技术难题。\n5、招募和管理公司技术研发团队，含后台、大前端、测试及运维。\n任职资格\n1、全日制本科及以上学历，8年以上工作经验，其中4年以上相关工作经验；\n2、有成功落地的互联网产品/大型社区平台开发/SaaS平台开发及团队经验；\n3、熟悉软件开发流程，较强的研发过程管控能力，对新技术、新应用敏感；\n4、对互联网行业有深入的了解，具有大型B端或C端的产品工作经验。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (113, 126, '职位职责：\n1、负责基础设施软件开发，必要时对硬件提出改进方案；\n2、领域包括存储、缓存、CDN、消息队列、业务部署系统、数据库等；\n3、操作系统级的子系统改进、优化，或新的子系统；\n职位要求：\n1、计算机、通信及相关专业本科以上学历；\n2、精通 Linux 环境下的 C/C++/Golang/Python/Shell 的开发，有丰富的高并发场景经验，代码质量有很高水平；\n3、熟悉 TCP/IP 通信原理和各种 NIO 模型的编程；深刻理解性能优化的原理和原则；\n4、责任心强，做事认真细致；沟通能力强，具备良好的团队协作精神，能独立工作；有强烈的进取心和求知欲，善于学习和运用新知识；\n5、具备以下条件之一者优先：具有内核、操作系统相关开发经验者；具有负载均衡、IPS、IDS等网络平台研发经验；具有CDN、Cache、Web server 研发经验；具有 DNS 相关研发经验者优先。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (114, 127, '职位职责：\n1、负责字节跳动全系支付/电商业务相关风控策略；\n2、通过对海量数据挖掘，分析用户行为，设计、实现相关算法模型。\n职位要求：\n1、具有良好的逻辑思维能力，熟悉常用的机器学习算法；\n2、对数据敏感，具备较强特征发现能力，有大数据处理相关经验；\n3、良好的团队合作精神，较强的逻辑思维能力、沟通能力和学习能力；\n4、有互联网相关风控、反作弊、反垃圾、反欺诈工作经验者优先', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (115, 128, '岗位职责：\n1. 负责带领团队进行机器学习和深度学习核心算法的研发,包括个性化推荐，趋势预测，智能风控等多领域的核心算法模型；\n2、解决算法落地过程中面临的数据探索，模型实验，模型服务化等各种工程化问题，沉淀算法模型能力，提升团队的模型应用效率；\n3、负责算法前沿领域的持续探索，带领团队针对业务目标进行算法的深度优化，不断打磨团队打造核心算法力量；\n\n任职要求：\n1. 熟悉机器学习与深度学习原理, 包括但不限于树型模型及其优化, svm, 神经网络等算法, 并且有高纬度稀疏数据训练的经验, 能够将算法运用到具体业务场景并推动落地；\n2. 有扎实的编程基础, 熟练使用python, spark, Hadoop等大数据工具, 熟悉后台开发流程；\n3. 有2年以上超过5人算法团队的带队经验, 能够lead项目发展, 拥有产品思维, 同时能够深耕业务, 探索顺丰在人工智能方面更多的落地场景；\n4. 良好的理解能力和学习能力，主动性和责任心强；\n5. 在**期刊发表过算法相关论文优先。\n工作地址', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (116, 129, '职位职责：\n1、为推荐、搜索、问答等功能设计和实现高质量的基础特征（Category,Topic, Entity等）。\n2、对用户以及用户的反馈（动作、评论）建模，快速定位问题与收集数据，设计解决方案，提升产品体验。\n\n职位要求：\n1、具备强悍的编码能力，有扎实的数据结构和算法功底。\n2、熟悉Linux开发环境，熟悉Python/Java/C++语言。\n3、 熟悉自然语言处理常见算法与模型（语言模型、MaxEnt/CRF, pLSA/LDA, w2v, CNN/RNN等）。\n4、参与或主导过NLP项目（如中文分词、文本分类、文本聚类）。\n5、发表过高水平学术会议论文者优先，对使用NLP技术解决实际问题尤为感兴趣者优先。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (117, 130, '职位描述\n基于现有大数据平台——\n\n1、搭建机器学习平台改进游戏业务；\n\n2、预测影响游戏的核心数据；\n\n3、推进人工智能在游戏方面的应用。\n\n\n\n任职要求\n1、硕士及以上学历，机器学习、统计学、计算机等相关专业优先；\n\n2、具备良好的统计分析基础和较高的数据敏感性，熟练掌握数据分析的体系流程与方法、常用的机器学习以及数据挖掘算法；\n\n3、有较强的算法基础和编程能力，熟练掌握Python，Java、Scala等至少一门语言，熟悉Hadoop、Spark等分布式计算和存储平台；\n\n4、熟悉使用TensorFlow、Pytorch、Keras等各大深度学习框架，熟练掌握深度学习模型调参优化方法，熟悉深度学习领域图像识别、语义分割、物体检测相关典型算法；\n\n5、有钻研创新精神，在国内外核心期刊发表过论文者优先；\n\n6、对游戏有研究，有游戏项目开发经验优先；\n\n7、能独立完成数据采集、清洗、数据整理、指标设计、数据分析和输出报告者优先；\n\n8、拥有优秀的逻辑思维能力、沟通表达能力以及方案输出与展示能力，工作积极主动，责任心强，具备良好的团队协作能力。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (118, 131, '岗位职责\n1.负责内容安全基础算法能力建设，包括自然语言处理、图像分类、目标检测、图像检索等模型建设；\n2.与策略运营、产品、工程方向配合，共同搭建内容安全防控体系；\n3.注重通用能力沉淀，搭建算法能力中台。\n\n岗位基本需求\n1. 计算机或相关专业硕士以上学历；\n2. 至少熟练掌握自然语言处理、计算机视觉两个方向常见任务的算法技术之一；\n3. 熟悉Tensorflow/Pytorch/Caffe等至少一种深度学习框架；\n4. 在多模态学习方向有相关项目和产品经验，对多模态特征的表达和融合、跨模态特征对齐、协同学习算法有深入研究和应用；\n5. 有深度学习对抗生成实践经验；\n6. 熟悉GPU计算，有GPU推理加速经验。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (119, 132, '职位描述：\n1. 语音识别技术及相关算法的研究与开发；\n2. 语音识别系统的数据处理、模型训练结果分析实验证；\n3. 基于海量数据的模型训练、词汇连续语音识别系统开发 ;\n4. 跟踪国内外最新的语音识别相关先进技术 。\n\n岗位要求：\n1、精通语音识别 /模式识别 /神经网络 /信号处理、机器学习等相关算法 ；\n2、 有大型公司语音识别开发经验者优先；\n3、 较强的沟通和表达能力，良好抗压有自学习团队协作精神 ；', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (120, 133, '1.负责图像处理、图像分割、特征抽取等算法核心技术的研发工作；\n2.参与跟抠图, 滤镜, 视频特效产品的研发工作；\n3.推动算法在应用领域的性能优化和落地。\n任职要求：\n1.3-5年相关工作经验，本科或以上学历，计算机、电子信息、软件、数学或物理等相关专业；\n2.可接受优秀应届硕士毕业生；\n3.熟悉图像处理基本算法（目标检测、图像分割、图像识别、图像分类等），有相关项目经验或者较好的研究成果；\n4.掌握机器学习领域的基本算法，在深度学习领域有实际项目经验；\n5.具备良好的编程能力，精通C/C++编程语言，熟练掌握Python', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (121, 134, '1、 硕士及以上学历，计算机、数学等相关专业；\n2、 熟练掌握计算机视觉、深度学习的基本方法；\n3、 较强的算法实现能力，熟练掌握C/C++编程，熟悉Shell/Python/Matlab编程之一;\n4、 具有丰富的深度学习框架（如Caffe，TensorFlow，MXNet，Torch）应用经验；\n5、 优秀的分析问题和解决问题的能力，对解决具有挑战性的问题充满激情；\n6、 良好的沟通能力和团队合作能力。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (122, 136, '我们需要你：\n1、通过相关沟通工具，对收钱吧相关产品销售过程进行远程支持，包括PC插件销售售前咨询、安装协助、售后维护支持等。\n2、协助收钱吧相关新产品试点组织，及效果跟踪；\n3、领导交办的其他工作。\n我们希望你是：\n1、1年以上相关工作经验，大专及以上学历，计算机相关专业优先；\n2、具备PC安装基础能力；\n3、熟悉市场上常规收银系统原理及操作者优先；', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (123, 137, '1.负责平台架构牵头的技术类产品starlink的运营推广工作；提炼产品的服务价值，与部门一起制定策略去表达产品的核心声音\n2.负责Devops平台的全流程运营推广；通过不同的技术手段与内容表达方式，在不同的技术场合或活动代表平台向目标人群布道；负责项目规划咨询、售前支持，为用户提供技术咨询，撰写整体规划方案\n3围绕云平台、starlink devops ’中间件产品撰写高质量技术文档、示例代码和创新性的相关场景化内容；协助关键目标客户，梳理微服务架构演进方案。协助客户业务调优，测试，上线\n4.组织并推进跨部门的产品推广工作，维护部门间的良好沟通和协作关系；解读行业需求，设计能够支持行业场景的具体云计算和大数据等平台性解决方案，把需求传递给方案开发和测试验证，并且进行方案的包装和培训输出。\n5.负责产品运营团队的团队建设、促进团队沟通，提升团队凝聚力。\n\n岗位要求：\n1.5年以上工作经验，有项目管理、Devops产品经验;熟悉某开发语言或平台中的至少一种，并有实际项目经验。\n2.熟悉 Linux、Serverless、Docker、微服务架构、springcloud、dubbo、service mesh等主流互联网技术栈和架构模式\n3.熟悉云计算领域技术和生态; 熟练使用jira等项目管理工具；\n4.有scrum敏捷实战经验，具有PMP、Scrum Master/Po等认证者优先；\n5. 极强的学习能力，过硬的沟通、演讲和技术文章写作能力，能够很好的协调跨部门间的沟通和协作。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (124, 138, '岗位职责：\n1、负责公司零售设备的安装调试，故障维修，升级维护等工作；\n2、接收客户的返修产品，检查、故障判定、登记，对故障产品进行维修；\n3、维修后产品功能全面测试，维修过程系统记录；\n4、负责退货产品的验收和入库。\n\n任职资格：\n1、大专以上学历（机电电子信息工程相关专业优先）； \n2、电子信息工程及机械相关专业，精通电气、电子电路基本原理； \n3、有责任心，能吃苦耐劳，有合作精神； \n4、我们期望您肯学、肯做，踏实肯干。因为我们招聘的不是普通的员工，而是培养安装、调试、维修样样精通的人才。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
