INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (127, 475, '岗位职责：\n1、根据领导指令完成证券交易、盘后数据统计；\n2、跟踪核⼼股票池信息，编制投资⽇报、周报、⽉报等；\n3、协助领导完成其他任务。\n任职要求：\n1、⾦融、投资、经济管理或理⼯类相关专业本科（211或985）及以上学历，具有复合学科背景优先；\n2、具备⼀定的财务、经济、⾦融等⽅⾯的常识；\n3、较强的⽂字表达能⼒，良好的信息收集和整理能⼒、熟练使⽤互联⽹及办公软件，能够独⽴撰写企业、⾏业的研发性⽂章或报告；\n4、具备优秀的逻辑思维能⼒、沟通协调能⼒，对新鲜事物具有好奇⼼和持续学习动⼒；\n5、具有咨询公司、投资公司相关实习经历或⼯作经历，具有基⾦从业、证券从业资格优先考虑；', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (128, 476, '职位职责：\n1、对××行业信息进行收集整理，包括行业相关政策法规、市场发展动态，行业重点企业情况，商业模式等，并产出行业研究报告；\n2、判断行业发展趋势，形成行业洞察，找到行业痛点，发现新的商业机会；\n3、跟踪和调研目标行业中的重点、标杆企业，相关研究项目的牵头主导及研究成果报告的编制、汇报及内部分享。\n职位要求：\n1、本科及以上学历，3年以上相关工作经验，有咨询公司、市场研究公司、战略部门工作经历优先；\n2、能有效地与需求方沟通、提炼需求，独立完成完整的商业分析报告或咨询项目，并推动分析结果落地实施；\n3、具备分析及规律总结能力，具备创新思维能力，逻辑化，结构化思考能力，优秀的沟通协调能力。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (129, 477, '职位职责：\n1.包括保理费管理、催收策略、保理资产监控、供应链资产风险评估等工作，监控资产状况，化解资产风险；\n2.制度流程、工具、系统等建设，联动业务部，推动资产管理体系的持续完善；\n3.确保数据准确，并对资产管理的数据进行汇总、分析和评价，出具资产方向相关报告及分析结果；\n4.资产监控渠道和资源方向的拓展、建立与维护，搭建完善培训体系；\n5.领导交办的其他工作事项。\n任职要求：\n1.本科以上学历；\n2.2-5年相关工作经验；\n3.供应链金融、租赁公司优先。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (130, 478, '岗位职责：\n1、公司重点项目的资本服务，包括项目评估、咨询、对接、服务等；\n2、投资项目分析，重点关注新能源新材料、人工智能、智能制造、生物医疗健康、AI技术等赛道；\n3、开发和维护投资机构、投资人等资源，打通一级市场头部投资机构的合作关系；\n4、与PE/VC机构建立深度合作关系，定期拜访沟通，为项目方提供资源支持与服务；\n5、组织、设计合理的投资方式、投资方案、投资架构、投资策略、投资协议，完成投资谈判、协议签署等工作；\n6、负责平台产业基金的设立，包括基金筹建、项目储备、基金募资等；\n7、负责特定创新链和产业链的融合对接。\n\n任职要求：\n1、具有金融、经济等相关专业全日制本科及以上学历；\n2、五年及以上投融资或FA相关工作经验；全程参与操作过 3个及以上投融资成功案例；\n3、熟悉创业投资行业、股权投资行业等相关财务、税收、法律、估值等方面的知识，熟悉投融资业务的各个环节，能够独立完成融资用的商业计划书；\n4、具备投资相关知识和经验，具备项目投资管理和项目管理知识，熟悉投资流程以及能把握投资方向；\n5、具备独立的项目调研和判断能力、较强的归纳总结及分析能力、具有较强的项目执行能力；\n6、工作细致、认真、有责任心，具有良好的团队意识，强烈的服务意识，团队协调能力强，以结果为导向的工作态度。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (131, 479, '岗位职责:\n能够独立完成行业追踪、监控、调研并形成科学、详尽、持续更新的研究报告，并提出战略性投资建议；\n进行项目探访并lead投资执行（包括尽职调查、项目估值、形成相关报告文件等）；\n与各部门协作并协调第三方中介机构，高效高质量完成项目；\n进行已投项目的投后管理；\n支持投资管理部领导的其他日常工作。                                                                                                               \n任职要求:\n有5年左右专注于互联网或者传媒行业投资经验；\n本科或者以上金融相关学科学历，成绩优异；\n持续关注互联网和传媒行业，对于其发展能形成见解；\n能够熟练应用excel、PPT、对于财务模型、估值分析有丰富经验；\n能够熟练应用口语以及书面英文；\n严谨、有责任心、注重细节、勤恳上进、有团队协作精神；\n优先录用有海外经历者。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
