INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (133, 481, '岗位职责：\n1、根据公司业务战略规划，制定相应融资方案，执行落地并达成融资目标；\n2、与各大银行、券商、租赁、基金、头部企业、知名FA机构等融资渠道建立并保持优质的合作关系；\n3、接触市场中符合公司发展要求的各类资本，确保公司所需资源及时匹配，保障公司资金有序、安全、高效流动；\n4、不断开发、拓展融资新渠道，设计可行的合作模式，支持公司发展；\n5、负责商业计划书和融资文件的准备，推动签约和交割相关工作，归档和维护融资相关的重要文件；\n6、接待投资者的日常垂询、考察访问，完成领导安排的相关工作。\n  \n任职要求：\n1、全日制本科及以上学历，金融、经济、财务等相关专业；\n2、具有较成熟的融资渠道资源、丰富的资本市场关系，具有地产类、科技类、或数据中心类项目融资的相关经验及资源；\n3、熟悉相关政策法规，有独立设计、操作、完成大型项目投融资成功案例者优先；\n4、具有优秀的资源整合、业务推进、项目筛选能力，有市场敏锐度；\n5、具有优秀的融资分析能力和判断能力，较强的谈判技能；\n6、具备较强的责任心、执行力，优秀的沟通表达、组织协调能力，能承担一定工作压力。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (134, 482, '岗位职责：                                                                                                                                                                                       \n1、直接从事海外并购项目或潜在国内买家的开发，销售平台产品，通过维护开发与重要海内外机构、合作伙伴、产品用户的长期合作关系，进一步寻找、跟踪、评估国际并购项目机会；\n2、维护与重要海内外机构、合作伙伴、平台用户的长期合作关系，密切关注大客户的服务需求，并及时提供解决方案和附加服务；\n3、分析、掌握、预测中国跨境投资并购趋势，为公司决策提供参考意见；\n4、与公司的产品部门配合，深入了解合作伙伴和用户对产品的需求，并及时反馈给产品部门改善体验；\n\n任职要求：\n1、1年以上工作经验，英语可以用做工作语言；\n2、金融投资等相关专业毕业，对于跨国投资、并购、金融业务有扎实的理论和实务层面的了解；\n3、对跨境并购产业链条有深度接触，实际操作过完整的跨国项目并购，有投行、券商、FA、律所等相关工作经验优先；\n4、有主动积极和高效实干的业务开拓精神，在国内外已经建立客户人脉的优先；\n5、良好的人际沟通能力和客户服务意识，拥有出色组织协调能力和团队管理能力，对部门管理有一定驾驭能力；\n6、在金融行业具有大客户资源积累，有互联网企业销售经验且对数据库、财经类报告等知识性产品有较深认识的优先考虑。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (135, 483, '工作职责\n1. 投后项目管理及专项投后管理\n -对公司直接投资项目进行全面的投后管理，包括定期检视分析、特殊事件专项检视分析、现场回访等。\n -公司所投项目的客户关系日常维护和潜在业务机会发掘。\n -牵头执行协调各部门完成项目续期、受益人大会、项目提前到期等专项投后事件。\n -行业分析及学习，跟进行业内主要主体的经营情况及行业动态，在某些行业内形成专长。\n -维护内外部资金方关系，进行投后交流研讨。\n -牵头进行不良资产的处置。\n2. 事务性投后管理主要工作\n -各类投后管理报告的撰写。\n -集团内各公司的投后管理报告/研讨需求。\n -监管要求的各类定期报告。\n3． 适当进行直接投资业务拓展，发掘业务机会。\n\n任职要求\n1. 熟悉债权投资、股权投资等直接投资产品，具备较强风险管理意识。\n2. 保险资管信托等金融机构直接投资/非标投资业务投后管理相关经验。\n3. 性格开朗。具备较强的沟通协调能力、执行能力、学习能力、语言表达能力。\n4. 金融财务、商业分析方面理论知识及实践技能。\n5. 相关工作经验4-6年。条件特别优秀者可适当放宽。\n6. 硕士研究生，毕业于国内外重点知名院校。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (136, 484, '职位描述：\n1、负责企业客户的数据整理、协助项目经理开发客户，挖掘企业融资需求，与客户电话沟通居多。\n2、负责项目的跟进和路演的开展。\n\n任职要求：\n1、本科及以上21届应届生，对投融资业务有一定了解者优先；\n2、每周能到岗5天，沟通表达能力强，反应敏捷，有电销等实习经验优先。\n3、具有优秀的语言表达能力与沟通技巧,良好的人际交往能力,较强的学习能力及分析判断能力。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (137, 485, '', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (138, 486, '岗位职责\n1、负责完善新客户的资料并进行沟通，为潜在投资者进行电话或视频讲解与交流；\n2、通过电话或网络视频与客户进行有效沟通了解客户需求, 寻找销售机会并完成销售业绩；\n3、负责承接电视广告和网络热线，通过电话、网络、视频与客户交流，与客户进行有效沟通；\n4、定期与合作客户进行沟通，建立良好的长期合作关系。\n\n任职资格\n1、大专及以上学历\n2、19-28岁，口齿清晰，普通话流利，语音富有感染力；\n3、对销售工作有较高的热情；\n4、具备较强的学习能力和优秀的沟通能力；\n5、性格坚韧，思维敏捷，具备良好的应变能力和承压能力；\n6、有敏锐的市场洞察力，有强烈的事业心、责任心和积极的工作态度，有相关电话销售工作经验者优先。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (139, 488, '岗位职责：\n1、起草及审核公司风险控制的相关工作流程、制度，完善公司风险管理体系并对相关流程、制度提出改进意见；\n2、对投资基金、项目持续跟踪管理，及时发现业务风险点，并提出行之有效的风险控制措施；\n3、组织协调和督导各部门的运行符合法律法规、监管部门政策及公司制度的要求，监督各岗位工作的落实情况，对日常的合规风险进行识别，检查和及时报告；\n4、负责研究风险政策，对公司的决策、业务活动、风控决议进行合规审核，组织实施公司内部管理评估，对公司风险管理工作提出改进方案；\n5、完成上级领导交办的其他工作。\n任职要求：\n1、本科及以上学历，法律、财务、风险管理相关专业；\n2、为人正直，具有极强的沟通协调能力及亲和力，能够承受工作压力，具备担当意识；', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
