INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (142, 500, '岗位职责：\n1、 负责用户需求调研、分析整理及跟踪，撰写用户需求说明书与需求设计等相关文档；\n2、 使用Excel或者Matlab等工具对系统的指标及模型进行验证；\n3、 对项目组人员进行业务培训；\n4、 对用户进行业务及系统操作的培训；\n5、 及时了解并跟进用户方面的指标模型算法问题，协助支持人员及开发人员分析处理\n6、 深入挖掘系统相关业务功能，进行深入的市场需求、技术趋势了解与分析，不断完善和扩展系统功能。\n任职要求：\n1、 金融工程或金融学、数学、经济学专业背景学历；\n2、 熟悉证券投资理论及投资组合分析，数学功底好；\n3、 有较强的数据和业务分析能力、熟练掌握Excel或matlab等；\n4、 有较强的逻辑思维能力，分析能力，有丰富的金融及经济学理论知识，善于进行金融行业研究和挖掘；\n5、 具有沟通技巧、客户管理能力、问题定位、分析和总结能力；\n6、 具备钻研精神，能快速学习新业务，进行金融模型研究；\n7、 具备高度的责任感及较强的团队协作能力，工作态度积极；\n8、 良好的团队合作精神，具有沟通协调能力及语言表达能力，亲和力；\n9、 熟悉数据库或编程语言者优先，了解金融、证券或财务方面知识优先。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
