INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (146, 504, '岗位职责：\n1、负责客户咨询，协助客户开户\n2、帮助客户理财-证券、期货、港美股，给出投资理财方向和意见\n\n任职要求：\n1、本科及以上学历\n2、28周岁以内\n3、热爱金融行业，充满学习动力，抗压能力强\n4、沟通能力强、耐心细心有责任心\n5、注重团队协作', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (147, 505, '岗位职责：\n1． 推进集团分配的商机进程，配合独立或合理组织相关部门与客户进行沟通。\n2． 负责每月营销合同签订，履行，资金回收情况及指标完成情况。\n3． 每月商务数据统计、分析、支持，提前做好下一个月的规划。\n4. 负责协助处理客户来电后续情况追踪。\n5.  完成上级或公司交办的其它工作任务 。\n\n任职要求：\n1. 设计，市场营销等工作经验。\n2. 具有解决复杂问题的能力；很强的计划性和实施执行的能力；很强的激励，沟通，协调能力，责任心，事业心强，热情\n3. 熟练操作办公软件。\n4.    设计专业优先。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (148, 506, '岗位职责：\n一：不限经验、应届毕业生亦可，年龄19—34岁\n二：口齿清晰，思维敏捷，具有良好的沟通表达能力。\n三：热衷销售行业、具有较强的事业心与团队协作精神。\n四：公司有专业培训。\n\n任职要求：\n1、口齿清晰,普通话流利,语音富有感染力;\n2、敢于挑战自我，普通话标准，开朗大方，亲和力好\n3、有服务意识，有开拓精神和良好的团队合作意识，有很强的学习沟通能力福利待遇:\n4、对销售工作有较高的热情;\n5、具备较强的学习能力和优秀的沟通能力;\n6、性格坚韧,思维敏捷,具备良好的应变能力和承压能力;\n7、有强烈的责任心和积极的工作态度,有相关电话销售工作经验者优先（特别是有房地产或金融销售经验者优先录取）。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (149, 507, '', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (150, 509, '岗位职责：\n1. 针对不同类型用户，在数据分析的基础上，制定有效提升用户转化和留存、降低用户流失的运营方案及计划，并协调相关合作部门推动方案落地执行；\n2. 根据业务目标，策划各类活动，推动活动落地及目标达成；\n3. 负责搜集反馈的用户建议和产品缺陷，推动产品优化迭代；\n4. 分析平台内用户的行为模式和生命周期，协助构建用户体系；\n5. 了解互联网金融领域动向，及时、准确地研究、监控、分析并提出对策；\n任职要求：\n1.本科及以上学历，1年以上互联网金融平台运营推广经验；\n2.了解各类线上推广渠道和流量获取方式；\n3.擅长沟通和资源协调，优秀的创意策划和文案能力；\n4.目标导向，执行力强。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
