INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (156, 515, '岗位职责：\n从事股票日内、股票波段、股指期货、商品期货、期权的交易。\n任职资格：\n1.对金融市场具有浓厚的兴趣。\n2.人品端正，富有团队精神和纪律精神，具有较强的学习能力和钻研精神。\n3.敢于面对挑战和承担责任，可承受巨大的心理压力。\n4.对数字非常敏感，具有较强的逻辑思维能力，具备简单策略回溯能力更佳。\n5.手眼协调能力强，有竞技游戏高分段经历者优先。\n6.正规院校大专以上学历，专业不限。\n7.录取者将会接受专业的系统化入职培训。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (157, 516, '岗位职责：\n1、接受公司一系列相关培训，深度学习金融、保险、投资理财知识\n2、开发拓展客户资源，为客户制定资产配置方案\n3、对接公司客户，解答公司客户投资咨询类问题并提供投资建议\n4、收集市场信息，了解投资者需求，参与营销策划活动并负责执行\n5、领导交代的其他事宜\n职位要求：\n1、学历不限，有无经验均可\n2、有良好的协调沟通能力\n3、热爱金融行业，愿意在金融行业长期发展\n4、有上进心、责任心，富有团队精神', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (158, 517, '岗位职责：\n1、新法律法规跟踪解读：负责持续跟踪和掌握与公司利益相关的国家政策、法律法规及监管政策的变化，特别是与信贷业务相关的数据安全、个人信息保护等有关事项的更新情况。负责合规风险信息的汇集，定期或不定期向管理层汇报，提出改进建议。\n2、合规报告：结合监管及公司要求定期或不定期报告公司合规风险管理状况。\n3、合规审核：负责对公司重要的内部规章制度、业务流程、宣传资料、培训资料等方面进行合规审核，并出具审核意见；督促和监测相关部门、单位对合规检查中发现的问题及时进行整改。\n4、合规培训：组织公司法律、合规教育活动和培训。\n5、与监管部门联络沟通，协调监管关系维护工作；做好公司与监管机构之间的各项沟通工作。\n任职要求：\n1、全日制本科及以上，4年以上法律合规工作经验，通过国家司法考试。\n2、熟练掌握金融行业法律法规及监管规范性文件，熟悉互联网小贷、融资租赁、保理等业务模式；熟悉内控合规要求，熟悉国内监管思路、要求和监管方法。\n3、具有一定的文字功底，可独立完成各项合规相关的文件及报告的撰写工作。\n4、有数据合规以及隐私保护项目的经验优先。\n5、善于学习、勤奋努力，有较强的合规意识和沟通、协调能力。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (159, 518, '【岗位职责】\n1、 按照萨班斯法案（SOX）合规要求，编写或更新流程文档和风险控制矩阵，执行控制测试，沟通SOX控制缺陷，提出改进建议，跟进缺陷改进情况，评估缺陷影响；\n2、 配合协调外部审计师和外聘咨询顾问开展SOX合规工作；与公司内部相关团队和人员沟通、宣传SOX合规要求。\n3、 识别公司财务、IT、运营等流程中的风险点，针对识别出来的风险和管理问题，制定风险应对措施，同被审计部门进行及时沟通并提出审计建议，协助将重要的事项及风险状况主动通及时反映给管理层；\n4、 定期对内外部流程运行效率和执行情况进行监控、评估和分析，对重要的部门和业务进行内部审计，提出流程优化策略和建议，确保业务流程和控制有效执行。\n5、 根据内审部门工作计划开展各类日常内部审计项目，协助定期向审计委员会及管理层的汇报工作；\n6、 收集、整理审计证据并进行分析、评价，形成审计底稿及相应审计结论；\n7、 协助完成内审报告，与被审计业务相关人员沟通确认审计发现并提出改进建议，持续跟进审计发现、改进计划的落实情况，并向上级及管理层进行汇报；\n8、 推进审计发现的改进工作，与改进责任人积极配合，确保相关问题得到及时有效改进。\n9、 完成公司上级及管理层交代的其他工作。\n【岗位要求】\n1、 全日制本科及以上学历，经济、金融、财务、审计类专业优先；\n2、 至少3年及以上会计师事务所审计经验，或四大及咨询公司内审、内控领域专业经验，或企业内审、互联网行业、互联网IT内审从业经验。同时拥有四大和企业内审经验者优先；\n3、 熟悉萨班斯法案合规要求，熟悉COSO及ERM模型；\n4、 熟悉ITIL、COBIT等IT服务及IT审计标准，对IT控制以及IT审计流程、方法有深刻认识，具备独立管理IT审计项目的能力，能独立执行IT审计，审计公司各信息系统、信息安全和IT运营等；\n5、 具备专业审计素养与踏实诚信的职业素养，良好的工作态度和学习能力，高度的自我驱动和结果导向；\n6、 具有较强的风险识别能力、逻辑分析能力，具有良好的独立工作能力；\n7、 具有良好的内外沟通协调能力和跨部门协作能力；\n8、 具有良好的中英文口头表达和文字呈现能力；\n9、 持CPA、CIA、CISA证书或其他相关资格证书者优先', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (160, 519, '工作职责：\n1. 负责与机构的结算工作、日常资金对账、差错处理等；\n2. 负责解答其他部门沟通有关账单的疑问；\n3. 领导交代的其他工作等\n\n工作要求：\n1. 全日制本科及以上学历，统计、数学、财务专业优先；\n2. 具有两年相关工作经验；\n3. 工作认真踏实，较强的数据处理能力，熟练应用excel等office办公软件；\n4. 具有良好的团队合作意识，较强的沟通能力\n工作地址', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (161, 521, '', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (162, 522, '岗位职责\n1. 规划某一渠道产品开发计划、进度；协同前中后台部门讨论，确定产品形态；\n2. 新产品报备材料准备与复核、拟定并复核产品定价报告；\n3. 负责再保沟通洽谈、协调再保与我司核保拟定核保规则；\n4. 负责持续搭建并维护标准化定价模型，管理、分析不同基础下产品利润情况；', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (163, 523, '职位描述：\n1. 制定理赔业务流程及运作规范，控制理赔风险，提高理赔效率及服务质量；\n2. 对理赔权限内的案件进行审批，评估理赔风险；\n3. 对新产品提出合理的建议和意见；\n4. 执行/完成上级交办的其它工作。\n\n任职要求：\n1. 本科及以上学历，医学、保险相关专业优先考虑；\n2. 具有3-5年人身险（含健康险）理赔业务相关工作经验；\n3. 了解保险业务相关法律法规和各地区现行医疗体制；\n4. 性格稳重、开朗、有高度责任心、有较强团队合作意识。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (164, 525, '', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (165, 526, '职位描述：\n利用公司资源以及自有资源开发客户。\n证券账户开立；\n公募基金销售；\n私募基金销售；\n理财产品销售。\n为客户进行合理化的资产配置。', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
INSERT INTO `db_worldelite`.`t_job_desc_example` (`id`, `category_id`, `description`, `create_time`, `update_time`, `del_flag`) VALUES (166, 527, '岗位职责：\n1、负责协助投资总监研究制定股市投资主线，围绕其输出股市专业内容输出；\n2、负责证券服务落地，编写主题投资研报，围绕机会标的给出盘中操作指导；\n3、负责关注股市热点行情追踪、影响股市板块重大事件消息筛选与解读；\n4、对接跨部门证券专业内容需求支持。\n任职要求：\n1、本科及以上学历,金融相关专业优先；\n2、2年以上证券行业经验，持有证券分析证书者优先；\n3、懂股票技术分析，宏观面基本面研究扎实，会选股优先；\n4、股票分析市场敏感度极高，宏观经济政策+行业动态+国内外政治经济军事等财经讯息', '2020-09-14 09:36:37', '2020-09-14 09:36:37', '0');
